REPLACE INTO `Trips` (`id`, `name`, `short_description`, `description`, `price`, `tickets`, `image_path`, `start_date`, `end_date`, `category_id`, `author_id`) VALUES
	(1, 'Izlet na Maldive', '', 'Ne zaboravite ponijeti skafander', 250, 20, '2024329-2546316473-maldvi.jpg', '2024-03-29', '2024-04-01', 1, 1),
	(2, 'Putovanje u Egipat', '', 'Egzotično putavanje u Egipat', 800, 40, '2024329-8034686560-egipt-3-1024x736.jpg', '2024-05-29', '2024-06-01', 2, 1),
	(3, 'Krstarenje Island i Farski otoci', '', 'KRSTARENJE ISLAND I FARSKI OTOCI jedinstveno putovanje autobusom i brodom do dalekih otoka sjevernih mora. 12 dana/11 noćenja putovanje autobusom i brodom', 900, 40, '2024329-8662349004-otoci.jpg', '2024-05-01', '2024-05-15', 3, 1),
	(4, 'Istanbul, 4 dana PREMIUM', '', 'Putovanje u Istanbul zrakoplovom iz Zagreba! Garantirani polasci! 4 dana/3 noćenja!', 955, 45, '2024329-8356531562-stambul.jpg', '2024-04-19', '2024-04-23', 3, 1),
	(7, 'Dubai s izletom u Abu Dhabi, 30.4.', 'Putovanje u Dubai, 6 dana/ 5 noćenja', '<iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://www.youtube.com/embed/VE75g0frvr4?showinfo=0"></iframe><p><br></p><p><strong>1. dan ZAGREB – DUBAI</strong></p><p>Okupljanje u Zračnoj luci Zagreb Franjo Tuđman ispred šaltera informacija 2 sata prije leta. Susret s pratiteljem te prijava na direktan let za Dubai. Dolazak u Dubai u večernjim satima.</p><p>Nakon carinske kontrole slijedi organizirani transfer do hotela. Smještaj. Noćenje. *točan red letenja za svaki polazak je ispod programa putovanja</p><p><strong>2. dan DUBAI</strong></p><p>Nakon doručka odlazak na poludnevni razgled grada starog i modernog Dubaija. Panoramska vožnja najstarijim dijelovima Dubaija: Deira i Bur Dubai. Vožnja pored Bastakiye – stare četvrti autohtone arhitekture. Vožnja na drugu stranu zaljeva tradicionalnim brodićem abra do poznate tržnice začina,tekstila i zlata: spice souk i gold souk. Nastavak vožnje do dijela grada Za\'abeel gdje ćemo vidjeti fascinantnu palaču šeika Mohammeda, vladara Dubaia, a nakon toga nastavljamo vožnju do najluksuznijeg dijela Dubaia – Jumeirah. Zaustavljanje kod Burj Al Arab, jednog od najluksuznijih hotela na svijetu, u obliku jedra, Kraća pauza za fotografiranje. Slijedi odlazak do čuvene Dubai Palme – umjetno stvorenog otoka u obliku palme na kojem se nalaze luksuzni hoteli, stanovi, kuće i vile poznatih svjetskih zvijezda. S vidikovca The Pointe imat ćemo priliku popiti kavu ili sok te uživati u nezaboravnom pogledu na impozantan hotel Atlantis koji se nalazi na vrhu palme. Po silasku s palme odlazak do predivne Dubai Marine uz kraće zaustavljanje za slikanje. Nastavak vožnje cestom Sheikh Zayed, novim središtem grada (downtown) pored najvišeg tornja na svijetu Burj Khalife, visine 828 m i sa 160 katova. Kratka pauza za ručak. Predlažemo zajednički posjet najvišem vidikovcu na svijetu, Burj Khalifa (uz doplatu i prethodnu rezervaciju). Odmah do Burj Khalife nalazi se Dubai mall, najveći trgovački centar na svijetu, a uz njega i čuvene fontane u čijem showu možete uživati svakih pola sata u terminu od 18-23 sata. Slobodno vrijeme za shopping i šetnju do čuvenog spomenika The Wings of Mexico. Za kraj dana predlažemo večeru u nekom od lokalnih restorana s pogledom na fontane. Povratak u hotel s pratiteljem putovanja ili individualno. Noćenje.</p><p><strong>3. dan DUBAI – izlet SAFARI</strong> <strong>uz večeru</strong></p><p>Doručak. Predlažemo zajednički odlazak do Mall of Emirates gdje se nalazi prvo skijalište zatvorenog tipa smješteno u trgovačkom centru gdje možete skijati i dok je vani +25 C (kompletnu skijašku opremu možete unajmiti uz kupnju ulaznice). Odlazak do Madinat Jumeirah, jednog od najljepših kompleksa hotela, trgovina, suvenirnica, restorana, ispresijecanih kanalima – mala Venecija Dubaija uz pogled na magičan hotel Burj Al Arab. Odlazak do čuvene JBR plaže gdje možete uživati u kupanju, shoppingu, brojnim restoranima i šetnici uz plažu, a nasuprot plaže i u neposrednoj blizini nalazi se i najveći kotač na svijetu Ain Dubai koji nudi pogled na Dubai s visine od 250 m. Ain Dubai je gotovo dvostruko veći od slavnog London Eye u Londonu. Ukoliko biste panoramu Dubaia željeli vidjeti iz zraka, predlažemo vožnju helikopterom koja pruža nezaboravan doživljaj Dubaija iz zraka. U poslijepodnevnim satima preporučamo zajednički odlazak na jeep safari uz večeru i zabavni program u pustinji. Jeepovi će po nas doći u hotel te zajedno odlazimo na nezaboravnu avanturu i adrenalinsku vožnju zlatno crvenim pješčanim dinama. Uživanje u zalasku sunca u pustinji. Dolazak u beduinski kamp gdje nas očekuje jahanje na devama, oslikavanje tijela kanom, sokolarenje, nargila… Slijedi bogata večera uz arapski roštilj i tradicionalni program uz trbušne plesačice, tradicionalni ples tanouru te plesače koji izvode performanse s vatrom. Povratak u hotel s jeepovima. Noćenje.</p><p><strong>4. dan DUBAI – izlet ABU DHABI</strong></p><p>Doručak. Predlažemo zajednički odlazak na cjelodnevni izlet u Abu Dhabi (uz doplatu), glavni grad Ujedinjenih Arapskih Emirata, a smatraju ga i jednim od najmodernijih gradova na svijetu. Abu Dhabi je grad koji nudi kilometre pješčanih plaža i više od 200 otočića razasutih ispred obala Abu Dhabia. Posjetit ćemo jednu od najvećih novosagrađenih džamija na svijetu – čisto remek djelo, džamiju Šeika Zayeda koja odiše bogatstvom i raskoši, prima 40.000 vjernika te zaista ostavlja bez daha! Zatim ćemo se provesti kroz rezidencijalne četvrti grada. Odlazimo do Marina malla gdje ćete imati kraći pauzu za ručak i shopping.. Naš razgled nastavljamo odlaskom do čuvene palače Qasr Al Watan koja služio kao predsjednička palača ili „ Palača nacije „ koja je tek nedavno otvorila svoja vrata za javnost. Raskošna palača svojim dizajnom odaje počast arapskoj arhitekturi i dizajnu.. Još jedno remek djelo koje zaista oduzima dah. Nakon toga predlažemo posjet čuvenom hotelu Emirates Palace, jednom od najraskošnijih hotela na svijetu, gdje možete popiti kavu s listićima od zlatne prašine i uživati u raskošnom hotelu i njegovoj terasi. Povratak prema Dubaiju u poslijepodnevnim satima uz kraće zaustavljanje na otoku Yas gdje se nalazi jedna od atrakcija Abu Dhabia – Ferrari World i gdje ćemo imati priliku vidjeti stazu Formule 1, završnu utrku ovog natjecanja i jedinu utrku na svijetu koja se održava pod svjetlima reflektora. Zaustavit ćemo se i kod novo otvorenog muzeja Louvre Abu Dhabi. Muzej se sastoji od 55 bijelih zgrada, podignutih nad morem i nadsvođenih kupolom od 180 metara sa 7.850 metalnih zvijezda kroz koje prodiru sunčeve zrak koje glavni arhitekt Jean Nouvel naziva \'svjetlosnom kišom\'. Povratak u Dubai. Slobodno vrijeme. Predlažemo odlazak na piće u jedan od poznatih roof top barova. Povratak u hotel. Noćenje.</p><p><strong>5. dan DUBAI</strong></p><p>Doručak. Predlažemo organizirani odlazak autobusom do Miracle gardena, najvećeg cvjetnog park u ovom dijelu svijeta koji obiluje mnogobrojnim cvjetnim aranžmanima poput cvjetne palače, cvjetnog jezera, avion Airbus A380 napravljen od cvijeća i razne druge cvjetne instalacije koje će vas uvesti u svijet mašte, djetinjstva i kreativnosti. Nastavak vožnje do Dubai Frame-a, Nastavak vožnje do Dubai Frame-a, poznatog zlatnog okvira koji je u kratkom vremenu postao arhitektonski spomenik Dubaia. Smješten je u Zaabel Parku, a sa samog vrha ocrtava se nezaboravna vizura grada. Na visini od 150 metara, Frame s jedne strane pruža pogled na "stari" Dubai, s druge na "moderni" Dubai, a pritom hodajući po ostakljenom i prozirnom podu koji pruža nezaboravno iskustvo! Pauza da napravite vrhunske fotografije, a na kraju posjete pogledat ćemo i 3D video pod nazivom "Grad budućnosti" kao uvertiru za našu iduću atrakciju. 22.02.2022. u Dubaiju se otvorio dugoočekivani Muzej budućnosti. Eliptična metalna zgrada privlači pažnju svojim oblikom i visinom od 77 metara. U njoj se osim muzeja nalazi i veliki izložbeni prostor koji će služiti kao moderni hub. Za one koji su oduvijek željeli zaviriti u jedan od najluksuznijih hotela na svijetu, Burj Al Arab je nakon 18 godina odlučio po prvi puta otvoriti vrata posjetiteljima te nudi jedinstvenu turu u pratnji hotelskog butlera u trajanju od 90 minuta (uz doplatu i unaprijed napravljenu rezervaciju). Za obožavatelje delfina predlažemo plivanje s delfinima u Aquaventure parku u hotelu Atlantis. Zadnju večer rezervirali smo za vas nešto posebno. Predlažemo zajednički odlazak na krstarenje Dubai Marinom s večerom na tradicionalnom drvenom brodu „dhow“, uz pogled na najljepše gradske znamenitosti poput otoka Blue Water, hotela Atlantis i Palme Jumeirah duž prekrasno osvijetljene Marine. Večera uključuje glavna jela, salate, deserte uz neograničen broj bezalkoholnog pića (transfer uključen u cijenu krstarenja). Povratak u hotel. Noćenje.</p><p><strong>6. dan DUBAI – ZAGREB</strong></p><p>Doručak. Transfer do zračne luke. Prijava na let za Zagreb. Slijetanje u Zagreb. Kraj programa.</p>', 254, 48, '202447-4861613889-dubai2.jpg', '2024-04-30', '2024-05-06', 1, 1),
	(8, 'Budimpešta, 2 dana autobusom', '', 'Polazak u 06.00 sati s dogovorenog mjesta u Zagrebu (točno mjesto polaska u završnoj obavijesti prije putovanja). Vožnja modernim turističkim autobusom uz usputna stajanja radi odmora do prijestolnice Mađarske, kraljice Dunava – Budimpešte. Po dolasku u gradsko središte prošetati ćemo  s pratiteljem putovanja od  impresivne Bazilike Sv. Stjepana, do trga Vorosmarty ter, slavne slastičarnice Gerbaud, do glavne trgovačke ulice Vaci Utca s bogatom ponudom suvenirnica, trgovina, ugostiteljskih lokala i šetalištem uz Dunav. Zajedničku šetnju završiti ćemo pred prekrasnom zgradom zatvorene tržnice u kojoj ćete pronaći  bogatu ponudu suvenira, vina, poznatih mađarskih rakija, različitih vrsta začinske paprike i veliki izbor zalogajnica s popularnim savijačama, gulaš juhom, raznim vrstama ko', 225, 45, '202442-1166201320-8e0b0f_depositphotos_6892189_xl.jpg', '2024-04-20', '2024-04-22', 3, 1),
	(14, 'Rim, 4 dana avionom', '', 'TEst', 458, 35, '202445-6109158843-rim.jpg', '2024-04-07', '2024-04-10', 3, 1),
	(15, 'Bilbao i Baskija', '', 'IZVRSTAN RED LETENJA, HOTELI 4*, UKLJUČEN CJELODNEVNI IZLET SAN SEBASTIAN I GUERNICA', 885, 38, '202446-4185853826-bilbao.jpg', '2024-04-07', '2024-04-11', 1, 1),
	(16, 'Dolomiti - planinska bajka', 'Putovanje Dolomiti. autobusom iz Zagreba, Karlovca i Rijeke! 4 dana / 3 noćenja', '<iframe class="ql-video" frameborder="0" allowfullscreen="true" src="https://www.youtube.com/embed/kiYoMZmaaLU?showinfo=0"></iframe><h3><br></h3><h3>HOTEL U CENTRU BRUNICA, UKLJUČEN&nbsp;POSJET PREKRASNIM JEZERIMA LAGO DI BRAIES I MISURINA</h3><p><br></p><p><strong>1. dan&nbsp;ZAGREB – LAGO DI BRAIES - HOTEL&nbsp;</strong></p><p>Polazak autobusa u 05:00h iz Zagreba s dogovorenog mjesta ( točno mjesto polaska u završnoj obavijesti), nastavak putovanja uz mogućnost ukrcaja putnika u Karlovcu i Rijeci (uz prethodnu najavu). Slijedi ugodna vožnja visoko turističkim autobusom uz kraća stajanja radi odmora do&nbsp;„najinstagramskijeg“ jezera LAGO DI BRAIES. Na&nbsp;nadmorskoj visini od 1494 metara uživati ćete u zapanjujuće lijepim Dolomitima koji se ujedno zrcale u smaragdno bistroj vodi. Po dolasku slijedi&nbsp;zajednička kružna šetnja uz obalu jezera, cca&nbsp;4 km, nakon čega slijedi kraće slobodno vrijeme. Nakon šetnje ( ili pauze za kavicu na tearsi)&nbsp;možete iznajmiti čamac te iskušati i vožnju ovim bajkovitim jezerom te snimiti fotografije iz jedne skroz drugačije perspektive. U dogovoreno vrijeme polazak prema hotelu. Smještaj u hotel. Noćenje.</p><p><strong>2. dan&nbsp;MERANO – BOLZANO</strong></p><p>Doručak. Odlazak prema južnom Tirolu i poznatom lječilišnom gradu Merano. Dolazak do romantičnog dvorca Trauttmansdorff na čijem se posjedu nalazi zadivljujući botanički vrt kojeg čini kompleks od 80 vrtova podijeljenih na 4 tematska vrtna područja i to na površini od 12 hektara. Svojim oblikom amfiteatra te položajem na sunčanoj nizbrdici sa zapanjujućom panoramom Alpa, vrtovi prekrasno ujedinjuju umjetnosti i prirodu, a 2013. osvajaju vrtnog Oscara – nagradu najljepšeg vrta na svijetu! Slobodno vrijeme za istraživanje dvorca i vrtova. Odlazak do centra grada, slobodno vrijeme. Vožnja do Bolzana – glavnog grada pokrajine poveznice između talijanskog govornog područja – Trentina i njemačkog govornog područja – Južnog Tirola (Alto Adige). Grad je smješten na dvije rijeke i okružen trima planinama. Šetnja centrom grada: gotička katedrala Maria Himmelfahrt, trg Walther, trg Erbe, Via Portici…</p><p>U slobodno vrijeme predlažemo da pogledate mumiju staru 5300 godinu koju su očuvanu u alpskom ledu 1991. pronašli njemački turisti, popularno zvanu Otzi. Odlazak do hotela. Noćenje.</p><p><strong>3.DAN&nbsp;TRENTO&nbsp;</strong></p><p>Doručak. Vožnja do Trenta, glavnog grada pokrajine Trentino, smješten uz slikovitu rijeku Adige. Šetnja starom povjesnom jezgrom: Piazza Duomo, Palazzo Pretorio; romaničko-gotička katedrala San Vigilio, romaničke crkve San Apollinare i San Lorenzo, crkva Santa Maria Maggiore, dvorac Castello del Buon Consiglio... Slobodno vrijeme za isprobavanje lokalnih specijaliteta. Predlažemo posjet jednoj od najstarijih pivnica gdje uz lokalna piva možete kušati lokalne sireve i tirolski špek. Povratak u hotel u dobrom raspoloženju.</p><p>***Za sve avanturističkog duha koji žele provesti dan uživajući u ljepotama Dolomita i obližnjih jezera predlažemo da se nakon doručka uputite u istraživanje pješačkih staza regije. Noćenje</p><p><strong>4. DAN&nbsp;LAGO DI MISURINA – CORTINA D’AMPEZZO-&nbsp;ZAGREB&nbsp;</strong></p><p>Doručak. Vožnja do najvećeg&nbsp;prirodnog jezera Cadore-&nbsp;jezero Misurina. Predlažemo šetnju oko jezera ili uživanje u jednom od kafića/restoran uz pogled koji oduzima dah&nbsp;na poznate&nbsp;Tre Cime!&nbsp;Nakon pauze nastavak putovanja do kraljice talijanskih Dolomita – Cortine d\'Ampezzo koja je već desetljeća stjecište bogatih i slavnih koji se ovdje dolaze skijati, ali i vidjeti i biti viđen. Slobodno vrijeme za kratki shopping u elitnoj trgovačkoj ulici Corso Italia ili aperol na jednom od šarmantnih trgova ili odlazak na žičaru( u terminima kad je operativna), koja će nas odvesti do TOFANA DI MEZZO -&nbsp;najvišeg vrha Cortine na 3244 m/nv. i uživanje u spektakularnom pogledu na veličanstvene Dolomite. Nakon pauze vožnja prema Rijeci/Zagrebu. Dolazak u Rijeku/Zagreb u kasnim večernjim satima.</p><h4>***Važna napomena: redoslijed obilazaka podložan je promjenama ovisno o prometu i procjeni&nbsp;pratitelja putovanja.</h4>', 760, 25, '202447-5222647383-dolomiti.jpg', '2024-04-21', '2024-04-24', 4, 1);
