REPLACE INTO `comments` (`comment_id`, `text`, `user_id`, `created_at`, `parent_comment_id`, `ticket_id`) VALUES
	(1, 'Notifikacija klijentska stigla na mail!\nNotifikacija administratora grupe stigla na mail!\nDa li je stigla notifikacija o traženju infomacije od korisnika?', 148, '2024-01-09 14:26:45', NULL, 28),
	(2, 'Da notifikacija je stigla na mail!', 148, '2024-01-15 14:27:26', 1, 28),
	(3, 'Testiram prikaz komentara administratorskih kada traže informaciju, i prikaz komentara klijenata kada odgovaraju na informaciju!\nOvaj komentar je u roli administratora!', 148, '2024-01-15 14:34:03', NULL, 28),
	(4, 'Ovo je odgovor na komentar u ulozi korisnika!', 148, '2024-01-15 14:41:21', 3, 28),
	(5, 'Tražimo informaciju od korisnika, da nam dostavi nešto vezano za ovaj tiket, što će nam pomoći da realizujemo tj. Zatvorimo isti.', 148, '2024-01-16 08:46:39', NULL, 28),
	(6, 'Klijent odgovara na ovu traženu informaciju, te istu dostavlja agentu na mail kao notifikaciju. Agent bi je trebao vidjeti na helpdesku isto kao što klijent vidi na svojoj profilnoj stranici.', 148, '2024-01-16 08:49:05', 5, 28),
	(7, 'Samo test', 148, '2024-01-16 10:04:21', NULL, 28),
	(8, 'Odgovor', 148, '2024-01-16 10:14:10', 7, 28),
	(9, 'Traži se informacija', 148, '2024-01-16 19:47:55', NULL, 28),
	(10, 'Šaljem infomaciju', 148, '2024-01-16 19:50:13', 9, 28),
	(11, 'Testiramo sada notifikaciju i tiket', 392, '2024-01-19 16:55:08', NULL, 28),
	(12, 'Ne ne, ovdje agent potražuje informaciju od m.ceric', 392, '2024-01-19 16:57:13', NULL, 28),
	(13, 'A ovdje klijent odgovara na notifikaciju', 148, '2024-01-19 16:58:48', 12, 28),
	(25, 'Potrazujemo informaciju od vlasnika tiketa Mudžahida', 392, '2024-01-21 02:15:36', NULL, 41),
	(26, 'Dobio sam informaciju na mail da me tražite, evo odgovaram vam na informaciju Admine.', 148, '2024-01-21 02:17:08', 25, 41),
	(27, 'Koji ID je tiketa otišao kao subject trebao bi 41', 148, '2024-01-21 02:23:09', 25, 41),
	(28, 'i dalje prikazuje 38, gledamo konzolu', 148, '2024-01-21 02:26:44', 25, 41),
