	(11, 'Philips 170S', 'Monitor Philips', 'Monitor Philips', 'Ugovor 11/2023', 4, '1300-100000', 20, 2, '2024-04-12 05:34:50', '2023-10-31 21:08:27'),
	(12, 'Philips S Line 20', 'Monitor Philips S Line 20"', 'Monitor Philips S Line 20"', 'Ugovor 12/2023', 4, '1300-100001', 35, 2, '2024-04-12 05:31:33', '2023-10-31 21:09:16'),
	(13, 'Dell 21,5"', 'Dell 21,5"', 'Dell 21,5"', 'Ugovor 13/2023', 4, '1300-100003', 29, 0, '2023-10-31 21:10:01', '2023-10-31 21:10:01'),
	(14, 'HP Compaq L1506', 'HP Compaq L1506', 'Monitor HP Compaq L1506 je osnovni model koji je pružao standardne performanse za osnovne računarske zadatke. Nema naprednih karakteristika ili tehnologija koje biste očekivali na modernijim monitorima.', 'Ugovor 14/2023', 4, '1300-100004', 3, 0, '2023-10-31 21:10:55', '2023-10-31 21:10:55'),
	(15, 'Dell OptiPlex 3080 SFF', 'Dell OptiPlex 3080 SFF je kompaktno i pouzdano stolno računalo koje je dizajnirano za poslovno okruženje. Opremljen Intel Core i3 procesorom desete generacije, različitim opcijama memorije i skladištenja, ovaj računar nudi solidne performanse za svakodnevne poslovne zadatke.', 'Dell OptiPlex 3080 SFF (Small Form Factor) je deo popularne OptiPlex serije stolnih računara koja je namenjena poslovnim korisnicima. Ovaj kompaktni računar nudi raznovrsne konfiguracije i opcije kako bi zadovoljio različite poslovne potrebe.\n\nProcesor ovog računara je Intel Core i3 desete generacije. Tačan model procesora može varirati, ali ova serija procesora pruža solidne performanse za svakodnevne poslovne zadatke. Sa 2 ili 4 jezgra, ovaj računar će se nositi sa standardnim poslovnim aplikacijama, web pregledanjem, i produktivnim zadacima.\n\nMemorija (RAM) opcije variraju, omogućavajući korisnicima da izaberu količinu RAM-a koja najbolje odgovara njihovim potrebama. Opcije za skladištenje takođe variraju, uključujući tradicionalne HDD-ove za veće kapacitete i brze SSD-ove za brži pristup podacima.\n\nGrafička kartica ovog računara je često integrisana, što je dovoljno za osnovne grafičke zadatke. Međutim, ovaj računar nije namenjen za zahtevne grafičke zadatke, kao što su 3D modeliranje ili igranje video igara.\n\nKonektori i portovi na OptiPlex 3080 SFF uključuju USB portove za povezivanje perifernih uređaja, HDMI i DisplayPort izlaze za povezivanje sa monitorima, audio portove za slušalice i mikrofon, Ethernet port za mrežno povezivanje, i druge relevantne portove.\n\nDell OptiPlex računari obično dolaze sa Windows operativnim sistemom, ali se mogu konfigurisati i sa drugim operativnim sistemima prema zahtevima korisnika.\n\nOvaj računar je dizajniran sa fokusom na pouzdanost i performanse u poslovnom okruženju, i nudi kompaktnu formu koja štedi prostor na radnom stolu. Idealno je rešenje za kancelarije, rad od kuće, i druge poslovne potrebe.', 'Ugovor 15/2023', 2, '1300-252563', 21, 0, '2023-11-05 16:06:40', '2023-11-05 16:06:40'),
	(16, 'Dell 23" P2319H', 'Dell 23 P2319H je profesionalni 23-inčni monitor dizajniran za kancelarijsko okruženje. Sa visokom rezolucijom, širokim vidnim uglovima i ergonomskim dizajnom, ovaj monitor pruža izuzetnu sliku i udobnost za produktivan rad.', 'Dell 23 P2319H je visokokvalitetni monitor dizajniran za poslovne korisnike koji zahtevaju pouzdanu i visoko funkcionalnu radnu stanicu. Ovaj 23-inčni monitor nudi visoku rezoluciju i razne karakteristike koje ga čine idealnim za kancelarijske zadatke.\n\nP2319H dolazi sa Full HD (1920 x 1080 piksela) rezolucijom, što pruža oštru i jasnu sliku. IPS panel ovog monitora osigurava široke vidne uglove i tačne boje, što je posebno korisno za grafički dizajn, foto-retuširanje i druge zadatke koji zahtevaju preciznu reprodukciju boja.\n\nErgonomske karakteristike ovog monitora uključuju mogućnost podešavanja visine, nagiba i rotacije. To omogućava korisnicima da prilagode monitor tako da odgovara njihovoj udobnosti i radnom okruženju. Takođe je kompatibilan sa VESA standardom za montiranje na zid ili nosače, što štedi prostor na radnom stolu.\n\nP2319H je opremljen raznim priključcima, uključujući HDMI, DisplayPort i VGA, što omogućava povezivanje sa različitim uređajima. Takođe ima USB priključke za povezivanje perifernih uređaja, kao što su tastature i miševi.\n\nOvaj monitor takođe ima anti-bljesak tehnologiju i nisku emisiju plave svetlosti kako bi smanjio umor očiju tokom dugotrajnog rada. To ga čini odličnim izborom za radno okruženje gde korisnici provode puno vremena ispred ekrana.\n\nDell 23 P2319H monitor kombinuje visoku rezoluciju, tačne boje i ergonomske karakteristike kako bi pružio produktivno i udobno radno iskustvo za poslovne korisnike.', 'Ugovor 16/2023', 4, '1300-2525663', 12, 2, '2024-03-06 10:05:48', '2023-11-05 16:18:35'),
	(17, 'Dell 24" P2422H', 'Dell P2422H je visokokvalitetni monitor sa ekranom veličine 23.8 inča, koji je idealan za produktivan rad u kancelarijskom okruženju. Sa visokom rezolucijom, širokim vidnim uglovima i brojnim korisnim funkcijama, ovaj monitor pruža izvanredno radno iskustvo.', 'Dell P2422H je profesionalni monitor sa tankim okvirom, veličine ekrana od 23.8 inča i Full HD rezolucijom (1920 x 1080 piksela). IPS panel ovog monitora omogućava široke vidne uglove i preciznu reprodukciju boja, čineći ga odličnim izborom za kreativne zadatke, grafički dizajn i multitasking.\n\nErgonomija je jedan od ključnih aspekata ovog monitora. P2422H ima mogućnost podešavanja visine, nagiba, rotacije i pivotiranja, tako da korisnici mogu prilagoditi poziciju ekrana prema svojim potrebama i udobnosti. Ovaj monitor takođe podržava VESA standard za montiranje na zid ili nosače, štedeći prostor na radnom stolu.\n\nPovezivanje sa različitim uređajima je lako zahvaljujući raznovrsnim priključcima, uključujući HDMI, DisplayPort, VGA i USB 3.0 hub sa četiri porta za povezivanje perifernih uređaja. Anti-bljesak tehnologija i niska emisija plave svetlosti štite vaše oči tokom dugotrajnog rada.\n\nMonitor Dell P2422H je energetski efikasan i ima sertifikate kao što su ENERGY STAR, EPEAT i TCO Certified Displays, što ga čini ekološki odgovornim izborom.', 'Ugovor 17/2023', 4, '1300-256455', 24, 0, '2023-11-05 16:24:11', '2023-11-05 16:24:11'),
	(18, 'Lenovo ThinkCentre M93', 'Lenovo M93 SFF ThinkCentre je kompaktna radna stanica koja pruža impresivnu izvedbu i pouzdanost za poslovne i uredske potrebe. Ovaj računar kombinira snažne komponente s kompaktnim faktorom oblika, što ga čini savršenim izborom za radne okoline s ograničenim prostorom.', 'Lenovo M93 SFF ThinkCentre je robustno izgrađen računar s modernim izgledom i praktičnom funkcionalnošću. Sa svojim kompaktnim dimenzijama, lako se uklapa na radni stol ili bilo koji drugi uredski prostor.\n\nOvaj računar dolazi s moćnim procesorima koji su sposobni za obradu kompleksnih poslovnih aplikacija i multitasking zadataka bez problema. Osim toga, ima mogućnost nadogradnje memorije i pohrane, omogućujući vam prilagodbu računara vašim specifičnim potrebama.\n\nLenovo M93 SFF ThinkCentre također ima brojne priključke za povezivanje uređaja i dodatne opreme, uključujući USB priključke, VGA i DisplayPort izlaze za spajanje na monitor(e), i druge.', 'Ugovor 18/2023', 2, '1300-254895', 16, 0, '2024-05-24 13:00:51', '2023-11-08 17:09:26'),
	(19, 'HP COMPAQ DC 7800', 'HP DC 7800 SFF (Small Form Factor) je izvanredan izbor za korisnike koji traže radnu stanicu za uredske i svakodnevne zadatke. Ovaj računar kombinira izvanrednu izvedbu s malim faktorom oblika, pružajući kompaktnost i snagu u jednom uređaju.', 'HP DC 7800 SFF dolazi s jednostavnim, ali elegantnim dizajnom koji će se uklopiti u bilo koji uredski prostor. Njegove male dimenzije čine ga savršenim za radne površine s ograničenim prostorom, a istovremeno nudi sve potrebne funkcionalnosti za produktivan rad.\n\nOvaj računar dolazi s raznovrsnim konfiguracijama koje uključuju različite procesore i količine memorije. Bez obzira na odabir, HP DC 7800 SFF osigurava glatko izvođenje aplikacija i efikasan multitasking.\n\nS obzirom na brojne USB priključke i druge konektore, HP DC 7800 SFF omogućuje vam da lako povežete sve potrebne uređaje i dodatnu opremu. Također nudi različite mogućnosti nadogradnje kako bi se prilagodio vašim budućim potrebama.', 'Ugovor 20/2023', 2, '1300-254565', 15, 7, '2023-11-08 21:10:55', '2023-11-08 21:10:55'),
	(20, 'HP ProBook 450 G8', 'HP ProBook 450 G8 s Intel Core i5 procesorom pruža spoj izvrsnih performansi, prijenosnosti i sigurnosti, čineći ga idealnim izborom za poslovne profesionalce i korisnike koji cijene visoke standarde kvalitete.', 'HP ProBook 450 G8 donosi robusnost i sofisticiran dizajn. Tanko kućište izrađeno od kvalitetnih materijala jamči izdržljivost, dok elegantan izgled odražava profinjenost. S Full HD ekranom i IPS tehnologijom, ovaj prijenosnik pruža oštar i živopisan prikaz.\n\nPokreće ga Intel Core i5 procesor najnovije generacije, što znači brze performanse i odličnu odzivnost sustava. Uz integriranu Intel UHD Graphics grafičku karticu, pruža dobro balansiranje performansi i autonomije baterije.\n\nZnačajke sigurnosti, poput čitača otisaka prstiju i HP Sure View tehnologije, čine ProBook 450 G8 pouzdanim partnerom u zaštiti vaših podataka i privatnosti.\n\nHP ProBook 450 G8 s Intel Core i5 procesorom pruža svestranost za rad u pokretu ili od kuće. Nudi snažne performanse, elegantan dizajn i niz značajki koje unapređuju vaše iskustvo rada.', 'Ugovor 20/2023', 10, '1300-254458', 4, 1, '2024-04-12 09:56:35', '2023-11-13 12:57:41'),
	(22, 'Philips Brilliance 190S', 'Philips Brilliance 190S je kompaktan monitor koji pruža oštar prikaz s preciznim bojama, čineći ga savršenim izborom za različite radne i zabavne scenarije.', 'Philips Brilliance 190S opremljen je 19-inčnim ekranom, pružajući dovoljno radnog prostora za produktivan rad ili uživanje u multimedijskim sadržajima. Elegantan i kompaktan dizajn ovog monitora čini ga prilagodljivim za razne radne prostore.\n\nMonitor koristi TFT-LCD tehnologiju za postizanje oštrih i jasnih slika. Širok kut gledanja omogućuje udoban prikaz iz različitih perspektiva. Osvjetljenje prilagodljivo okolini doprinosi udobnom iskustvu gledanja u svim uvjetima osvjetljenja.', 'Ugovor 25/2023', 4, '1300-254582', 7, 1, '2024-05-17 05:51:31', '2023-11-13 16:47:31'),
	(23, 'Philips LED TFT 19"', 'Philips LED TFT 19" monitor kombinira kvalitetan prikaz s energetski učinkovitom LED tehnologijom, pružajući korisnicima zadivljujuće iskustvo gledanja u kompaktnom obliku.', 'Ovaj monitor nudi 19-inčni zaslon s LED TFT tehnologijom, što znači da će slike biti oštre, jasne i bogate bojama. LED osvjetljenje ne samo da pridonosi kvaliteti slike već i pomaže u smanjenju potrošnje energije, čineći ga ekološki prihvatljivim rješenjem.\n\nSvestranost ovog monitora dolazi do izražaja kroz širok kut gledanja, pružajući konzistentan prikaz iz različitih perspektiva. Osim toga, brzo vrijeme odziva osigurava da akcijski prizori u video igrama ili filmovima budu glatki i bez zamagljivanja.', 'Ugovor 25/2023', 4, '1300-254584', 32, 6, '2024-03-26 06:50:35', '2023-11-13 16:56:24'),
	(24, 'Philips LED TFT 24"', 'Philips LED TFT 24" monitor pruža vrhunski prikaz i svestranost, čineći ga idealnim rješenjem za korisnike koji traže prostrani zaslon s visokom rezolucijom.', 'Ovaj monitor ima impresivnu dijagonalu od 24 inča, pružajući dovoljno prostora za multitasking, igranje igara ili gledanje filmova. LED TFT tehnologija osigurava jasne i živopisne boje, dok širok kut gledanja čini iskustvo gledanja ugodnim iz različitih perspektiva.\n\nS brzim vremenom odziva, ovaj monitor osigurava glatko iskustvo pri gledanju dinamičnih sadržaja. Povezivost je olakšana standardnim priključcima, a moderan i tanak dizajn dodaje sofisticiranost radnom okruženju.', 'Ugovor 26/2023', 4, '1300-2549623', 11, 1, '2023-11-13 17:18:22', '2023-11-13 17:18:22'),
	(25, 'Philips P-Line 24"', 'Philips P-Line 24" monitor predstavlja vrhunsku profesionalnu izvedbu, savršenu za poslovne korisnike koji cijene kvalitetu slike, ergonomiju i širok raspon povezivosti.', 'Ovaj monitor pruža impresivnu dijagonalu od 24 inča, uz izuzetnu rezoluciju koja omogućava oštar i jasan prikaz. P-Line serija odlikuje se visokokvalitetnim IPS panelom koji pruža realne boje, širok kut gledanja i visoku dosljednost boja.\n\nErgonomske značajke, poput podesivosti visine, nagiba i okretanja, čine radno okruženje prilagodljivim korisnikovim potrebama, pružajući udobnost tijekom dugih radnih sati. Povezivost je jednostavna zahvaljujući raznolikim priključcima, uključujući HDMI, DisplayPort i USB hub.', 'Ugovor 28/2023', 4, '1300-2978756', 2, 0, '2023-11-13 17:26:59', '2023-11-13 17:26:59'),
	(26, 'HP Compaq LA1951g', 'HP Compaq LA1951g monitor predstavlja pouzdan i svestran uređaj namijenjen profesionalnoj upotrebi. Sa svojim značajkama i pouzdanim performansama, ovaj monitor zadovoljava potrebe korisnika koji cijene kvalitetnu sliku i jednostavnost korištenja.', 'Monitor ima dijagonalu od 19 inča, pružajući dovoljno prostora za produktivan rad. Rezolucija ekrana omogućava jasan i oštar prikaz slike. Tehnologija TFT-LCD pridonosi živopisnim bojama i dobrim kutovima gledanja.\n\nErgonomske značajke uključuju mogućnost podesivosti visine, nagiba i rotacije ekrana, pružajući korisnicima fleksibilnost za prilagodbu radnog okruženja prema vlastitim preferencijama. Ovaj monitor nudi i ugrađene zvučnike za dodatnu praktičnost.', 'Ugovor 29/2023', 4, '1300-878932', 2, 1, '2023-11-13 17:31:32', '2023-11-13 17:31:32'),
	(27, 'ASUS LED TFT 19"', 'ASUS LED TFT 19" monitor pruža svestranost i kvalitetu slike, čineći ga izvrsnim izborom za različite svakodnevne zadatke. Sa svojim značajkama i pouzdanim performansama, ovaj monitor zadovoljava potrebe korisnika koji traže kvalitetan prikaz u kompaktnom obliku.', 'Monitor ima dijagonalu od 19 inča, pružajući optimalan balans između veličine ekrana i prostora na radnom stolu. LED pozadinsko osvjetljenje doprinosi energetskoj učinkovitosti i kontrastnom omjeru, pružajući jasnu i živopisnu sliku.\n\nOvaj monitor dizajniran je s naglaskom na jednostavnost korištenja i kompatibilnosti. Ergonomske značajke uključuju podesivost kuta nagiba ekrana za optimalan kut gledanja. Brzi odzivni vremena čine ovaj monitor prikladnim i za dinamične aktivnosti poput igranja igara ili gledanja video sadržaja.', 'Ugovor 30/2023', 4, '1300-2554845', 16, 5, '2024-03-06 09:44:21', '2023-11-13 17:35:14'),
	(28, 'Lenovo ThinkVision 24"', 'Lenovo ThinkVision 24" monitor predstavlja izvrsno rješenje za korisnike koji zahtijevaju visokokvalitetan prikaz slike, ergonomsku prilagodljivost te optimalnu produktivnost. Ovaj monitor kombinira sofisticirani dizajn s naprednim značajkama kako bi zadovoljio potrebe korisnika koji rade u različitim okruženjima.', 'Monitor ima impresivnu dijagonalu od 24 inča, pružajući dovoljno prostora za multitasking i rad s više prozora istovremeno. IPS panel osigurava visoku reprodukciju boja i širok kut gledanja, čineći ga idealnim za poslovne korisnike i kreativne profesionalce.\n\nVisoka rezolucija omogućava oštar i jasan prikaz detalja, čineći ovaj monitor pogodnim za rad s grafičkim sadržajem, tablicama ili složenim dokumentima. ThinkVision serija dizajnirana je s naglaskom na smanjenje zamora očiju, pa će dugotrajni radni sati biti ugodniji.', 'Ugovor 31/2023', 4, '1300-254488', 5, 0, '2023-11-13 21:52:59', '2023-11-13 21:52:59'),
	(29, 'Philips Brilliance LED TFT 24"', 'Philips Brilliance 240B je monitor vrhunske kvalitete, dizajniran za pružanje izuzetnog vizualnog iskustva kako u poslovnim, tako i u zabavnim aktivnostima. S odličnim značajkama i naprednim tehnologijama, ovaj monitor pruža oštar prikaz slike uz visoku funkcionalnost.', 'Monitor ima impresivnu dijagonalu od 24 inča, što ga čini idealnim za rad na više prozora istovremeno ili za uživanje u omiljenim multimedijskim sadržajima. LED TFT tehnologija osigurava živopisne boje i visoki kontrast, pružajući jasnu sliku s bogatim detaljima.\n\nPhilips Brilliance 240B posebno je prilagođen radu u uredskom okruženju zahvaljujući funkcijama poput mogućnosti podesive visine, nagiba i rotacije ekrana. Ove ergonomske značajke omogućuju korisnicima postizanje optimalne udobnosti prilikom rada, smanjujući napor na vratu i leđima.', 'Ugovor 31/2023', 4, '1300-5498353', 1, 0, '2023-11-13 21:59:38', '2023-11-13 21:59:38'),
	(30, 'Philips Brilliance 190C', 'Philips Brilliance 190C je kompaktni monitor s 19-inčnom dijagonalom, savršen za svakodnevnu upotrebu u kući, uredu ili učionici. Sa svojim kvalitetnim prikazom slike, ergonomskim dizajnom i pouzdanim performansama, ovaj monitor pruža izvrsnu vrijednost.', 'Monitor ima 19-inčni LED TFT ekran koji pruža jasnu i oštru sliku. Smanjeni okvir oko ekrana doprinosi modernom izgledu, dok LED tehnologija omogućava energetsku učinkovitost i živopisne boje.\n\nBrilliance 190C dolazi s podesivom postoljem koje omogućuje naginjanje ekrana prema potrebama korisnika, čime se osigurava optimalna udobnost pri radu. Smanjenje odsjaja i mogućnost montaže na zid dodatno povećavaju fleksibilnost postavljanja.', 'Ugovor 32/2023', 4, '1300-254514', 11, 2, '2024-03-06 09:41:40', '2023-11-13 22:03:23'),
	(31, 'ASUS LCD TFT 20"', 'ASUS LCD TFT 20" monitor predstavlja kombinaciju performansi i kvalitetnog prikaza slike, čineći ga odličnim izborom za rad, zabavu i svakodnevnu upotrebu. Sa svestranim značajkama i modernim dizajnom, ovaj monitor pruža izvrsno vizualno iskustvo.', 'Monitor ima 20-inčni LCD TFT ekran koji pruža žive boje i oštru sliku. ASUS-ova tehnologija osvjetljenja osigurava ravnomjerno pozadinsko osvjetljenje, eliminirajući sjene i poboljšavajući vidljivost. Brza brzina odziva čini ovaj monitor prikladnim za gledanje filmova, igranje igara i svakodnevne radne zadatke.\n\nElegantan i tanki dizajn s tankim okvirom čini ovaj monitor estetski privlačnim i lako se uklapa u različite radne prostore. Postolje omogućava prilagodbu nagiba ekrana prema vlastitim preferencijama, poboljšavajući ukupno korisničko iskustvo.', 'Ugovor 33/2023', 4, '1300-526542', 10, 1, '2023-11-13 22:19:36', '2023-11-13 22:19:36'),
	(32, 'PHILIPS 170C LCD TFT 17"', 'PHILIPS 170C LCD TFT 17" monitor predstavlja savršeno rješenje za one koji traže kompaktan monitor s kvalitetnim prikazom slike. Ovaj monitor nudi iznimno vizualno iskustvo i prilagodljivost za različite radne zadatke.', 'S tankim profilom i 17-inčnim LCD TFT ekranom, PHILIPS 170C pruža kvalitetan prikaz slike u kompaktnom pakiranju. Brza brzina odziva omogućava glatko gledanje filmova, igranje igara i rad na svakodnevnim zadacima. Tehnologija osvjetljenja pridonosi ravnomjernom prikazu boja i kontrasta.\n\nMonitor je opremljen standardnim priključcima za jednostavnu integraciju s različitim uređajima. Ergonomski dizajn omogućava prilagodbu nagiba ekrana prema korisničkim preferencijama, poboljšavajući ukupno iskustvo gledanja.', 'Ugovor 34/2023', 4, '1300-654332', 2, 0, '2023-11-13 22:25:51', '2023-11-13 22:25:51'),
	(33, 'DELL S2419H LED TFT 24"', 'DELL S2419H LED TFT 24" monitor kombinira sofisticiran dizajn s iznimnim vizualnim performansama, čineći ga savršenim izborom za korisnike koji traže vrhunski monitor za rad ili zabavu.', 'Elegantan i tanak dizajn DELL S2419H monitora odmah privlači pažnju svojom modernom estetikom. S 24-inčnim LED TFT ekranom pruža impresivan prikaz boja i kontrasta, čineći ga odličnim izborom za multimedijalne sadržaje, igre i svakodnevni rad.\n\nVisoka razlučivost omogućava oštar prikaz teksta i slika, dok tehnologija osvjetljenja pridonosi ravnomjernom prikazu boja. Tanki rubovi ekrana povećavaju doživljaj gledanja, posebno u višemonitorskim postavkama.\n\nMonitor podržava razne priključke, uključujući HDMI i VGA, pružajući fleksibilnost u povezivanju s različitim uređajima. DELL S2419H također ima ugrađene zvučnike za dodatnu praktičnost.', 'Ugovor 34/2023', 4, '1300-255458', 1, 0, '2023-11-13 22:29:13', '2023-11-13 22:29:13'),
	(34, 'DELL S2340L - 23"', 'DELL 23 Monitor - S2340L pruža kombinaciju elegantnog dizajna i kvalitetnog prikaza, čineći ga izvrsnim izborom za korisnike koji traže monitor visokih performansi s modernim izgledom.', 'S2340L se ističe tankim profilom i modernim dizajnom koji će se lako uklopiti u svaki radni prostor ili prostor za zabavu. S 23-inčnim ekranom, ovaj monitor pruža dovoljno prostora za produktivan rad ili uživanje u multimedijalnom sadržaju.\n\nIPS panel osigurava izvanredan prikaz boja i široke kutove gledanja, čineći ga prikladnim za različite aktivnosti poput uređivanja slika, gledanja filmova ili surfanja webom. Osvjetljenje pozadine pridonosi ravnomjernom prikazu boja, čak i u zahtjevnim situacijama.\n\nS2340L podržava više priključaka, uključujući HDMI i VGA, pružajući fleksibilnost u povezivanju s različitim uređajima. Tanki rubovi ekrana povećavaju doživljaj gledanja, posebno u višemonitorskim postavkama.', 'Ugovor 35/2023', 4, '1300-456842', 8, 0, '2024-01-30 07:07:52', '2023-11-13 22:32:55'),
	(35, 'PHILIPS LCD Monitor 19"', 'PHILIPS LCD Monitor 19" kombinuje visoku preglednost s efikasnim dizajnom, čineći ga pouzdanim izborom za svakodnevne radne zadatke i multimedijalno iskustvo.', 'Sa 19-inčnim LCD ekranom, ovaj monitor pruža optimalnu veličinu za radni stol, pružajući dovoljno prostora za više prozora i aplikacija. Kristalno jasan prikaz čini ga prikladnim za rad, učenje ili opuštanje uz omiljeni sadržaj.\n\nKvalitetan LCD panel pridonosi oštroj rezoluciji i realnim bojama, čime se osigurava dosljedna slika bez obzira na vrstu sadržaja koji se prikazuje. Brzi odzivni vremena čine ovaj monitor pogodnim za igranje video igara ili gledanje dinamičnih videozapisa.\n\nPovezivanje s drugim uređajima je jednostavno zahvaljujući različitim priključcima, a tanak profil monitora čini ga lako prilagodljivim radnom okruženju.', 'Ugovor 36/2023', 4, '1300-584855', 2, 0, '2023-11-13 22:40:17', '2023-11-13 22:40:17'),
	(36, 'Lenovo 24" - LT2423WC', 'Lenovo 24-inch Monitor, model LT2423WC, predstavlja izvrstan izbor za korisnike koji traže vrhunsku kvalitetu slike, visoku razlučivost i prilagodljivost radnom okruženju.', 'Ovaj monitor ima impresivan 24-inčni LCD ekran koji pruža visoku rezoluciju od 1920 x 1080 piksela. S ovim velikim ekranom, doživjet ćete oštru sliku i jasne detalje, čineći ga savršenim za multitasking i gledanje video sadržaja.\n\nNapredne značajke poput visokog kontrasta, široke palete boja i brzog odzivnog vremena osiguravaju izvrsnu reprodukciju slike. Monitor je idealan za svakodnevne radne zadatke, kreativne projekte ili uživanje u multimedijalnom sadržaju.\n\nErgonomski dizajn omogućuje prilagodbu visine i nagiba ekrana, pružajući vam udobnost tijekom duljih radnih sesija. Također, različiti priključci olakšavaju povezivanje s raznim uređajima.', 'Ugovor 38/2023', 4, '1300-559595', 2, 0, '2023-11-13 22:47:53', '2023-11-13 22:47:53'),
	(37, 'HP COMPAQ LE 1711', 'HP COMPAQ LE1711 je pouzdan i funkcionalan LCD monitor namijenjen poslovnim korisnicima koji traže jednostavnost, učinkovitost i visoku kvalitetu slike.', 'Monitor ima 17-inčni LCD ekran koji pruža jasnu i oštru sliku rezolucije 1280 x 1024 piksela. Ovaj format ekrana omogućuje učinkovito upravljanje radnim prostorom, čineći ga pogodnim za svakodnevne poslovne zadatke.\n\nS inovativnom tehnologijom prikaza, HP LE1711 osigurava živopisne boje, visok kontrast i brzo odzivno vrijeme. Sve to čini ga odličnim izborom za rad s dokumentima, pregledavanje internetskog sadržaja ili sudjelovanje u video sastancima.\n\nErgonomski dizajn monitora omogućuje prilagodbu nagiba ekrana, pružajući korisnicima mogućnost postizanja optimalnog kuta gledanja. Tanki okvir i kompaktna konstrukcija čine ga idealnim za postavljanje na radni stol bez zauzimanja previše prostora.', 'Ugovor 39/2023', 4, '1300-8465435', 1, 1, '2024-05-20 05:26:40', '2023-11-13 22:52:03'),
	(39, 'Philips Brilliance 200S', 'Philips Brilliance 200S je monitor namijenjen profesionalnoj upotrebi koji kombinira kvalitetan prikaz slike, ergonomsku prilagodljivost i moderni dizajn.', 'Ovaj monitor posjeduje 20-inčni LCD ekran s rezolucijom od 1600 x 1200 piksela, pružajući oštru i preciznu sliku. S tehnologijom prikaza visoke kvalitete, Brilliance 200S nudi živopisne boje, visok kontrast i brz odziv, što ga čini idealnim za profesionalne zadatke, grafički dizajn i multimediju.\n\nErgonomski dizajn omogućuje prilagodbu visine, nagiba, okretanja i rotacije ekrana, pružajući korisnicima mogućnost podešavanja monitora prema vlastitim preferencijama i potrebama. Ovaj nivo prilagodljivosti čini Brilliance 200S izuzetno udobnim za dugotrajnu upotrebu.\n\nPovezivanje s drugim uređajima olakšano je putem VGA i DVI priključaka. Tanak okvir oko ekrana pridonosi modernom izgledu monitora, čineći ga privlačnim dodatkom svakom radnom prostoru.', 'Ugovor 40/2023', 4, '1300-5815433', 1, 0, '2023-11-13 22:58:56', '2023-11-13 22:58:56'),
	(40, 'HP ProBook 4530s', 'HP 4530 je laptop koji pruža pouzdanu izvedbu i nudi niz značajki koje čine rad i zabavu jednostavnim i učinkovitim.', 'HP 4530 dolazi s ekranom od [navesti veličinu ekrana], pružajući jasnu sliku i živopisne boje. Opremljen je snažnim procesorom [navesti model i brzinu procesora] koji omogućuje brzo pokretanje aplikacija i multitasking. [Dodatne specifikacije poput RAM-a, kapaciteta diska, grafičke kartice itd.]\n\nTipkovnica je udobna za tipkanje, a touchpad omogućuje jednostavno upravljanje pokretima. Laptop također ima niz priključaka za povezivanje s drugim uređajima, uključujući USB, HDMI, i ostale.\n\nBaterija HP 4530 pruža dugotrajnu autonomiju, što ga čini idealnim za rad na putu. Tanka i lagana konstrukcija olakšava nošenje, dok elegantan dizajn dodaje dozu profinjenosti.', 'Ugovor 41/2023', 10, '1300-465435', 3, 2, '2024-01-29 12:51:55', '2023-11-13 23:03:19'),
	(42, 'HP ProBook 450 G5', 'HP ProBook 450 G5 je svestran i pouzdan laptop koji spaja snažne performanse sa modernim dizajnom. Ovaj uređaj je namenjen poslovnim korisnicima, ali je odličan izbor i za one koji traže svestran laptop za svakodnevne zadatke.', 'HP ProBook 450 G5 je odličan izbor za one koji traže laptop koji spaja izuzetne performanse sa elegantnim dizajnom. Bezbednosne karakteristike, kvalitetna tastatura i prenosivost čine ovaj laptop idealnim izborom kako za posao, tako i za svakodnevne aktivnosti.', 'Ugovor 41/2023', 10, '1300-4484565', 1, 1, '2024-01-29 11:05:55', '2023-11-13 23:10:28'),
	(43, 'Lenovo V310', 'Lenovo V310 je laptop koji kombinuje pouzdanost, performanse i pristupačnost. Ovaj model je posebno dizajniran da zadovolji potrebe poslovnih korisnika, ali je odličan i za svakodnevne zadatke.', 'Lenovo V310 je solidan izbor za one koji traže laptop sa izbalansiranim performansama i cenom. Svestranost ovog modela čini ga odličnim rešenjem kako za posao, tako i za svakodnevnu upotrebu.', 'Ugovor 44/2023', 10, '1300-4654654', 1, 0, '2023-11-13 23:14:33', '2023-11-13 23:14:33'),
	(44, 'Lenovo ThinkCentre E93 (SFF)', 'Lenovo ThinkCentre E93 Small Form Factor (SFF) je kompaktno i snažno radno računalo koje donosi efikasnost i pouzdanost. Sa svojim malim form factorom, lako se uklapa u radni prostor, dok istovremeno pruža performanse koje zadovoljavaju profesionalne zahteve.', 'ThinkCentre E93 SFF je deo Lenovo-ove ThinkCentre serije, poznate po izdržljivosti i dugovečnosti. Ovo računalo je namenjeno poslovnim korisnicima, ali će zadovoljiti i sve one koji traže pouzdano stacionarno računalo za kućnu upotrebu.\n\nDizajniran sa ciljem maksimiziranja radnog prostora, M93 SFF pruža snažne performanse uprkos svom malom form factoru. Ugrađeni komponenti omogućavaju brz i efikasan rad, čineći ga idealnim za multitasking i zahtevne poslovne zadatke.\n\nRačunar dolazi sa Windows operativnim sistemom, pružajući korisnicima poznato okruženje i laku integraciju sa drugim uređajima. Takođe, podržava i različite periferne uređaje, što ga čini fleksibilnim za razne poslovne potrebe.', 'Ugovor 45/2023', 2, '1300-587788', 10, 2, '2024-03-26 06:46:23', '2023-11-13 23:17:36'),
	(45, 'Canon CanoScan LiDE 200', 'Canon CanoScan LiDE 200 je kompaktan i visokokvalitetan skener namijenjen osobnoj upotrebi. Ovaj skener impresionira svojom tankošću i jednostavnošću, nudeći visokorazlučivo skeniranje bez kompliciranih postavki. Sa svojom brzinom i jednostavnim rukovanjem, LiDE 200 je idealan za korisnike koji žele brzo i lako digitalizirati dokumente, fotografije ili druge materijale.', 'CanoScan LiDE 200 je skener koji kombinira visoku kvalitetu skeniranja s elegantnim i tankim dizajnom. S tanke svega nekoliko centimetara, ovaj skener lako se uklapa u radni prostor bez zauzimanja previše prostora. Unatoč svojoj kompaktnoj veličini, LiDE 200 nudi visokorazlučivo skeniranje, čime zadovoljava potrebe korisnika koji traže vrhunske rezultate.\n\nOpremljen tehnologijom Canon FARE Level 3 za automatsko ispravljanje defekata slika, LiDE 200 osigurava jasne i oštre reprodukcije dokumenata i fotografija. Brza brzina skeniranja omogućuje korisnicima učinkovito digitaliziranje materijala bez gubitka vremena.\n\nJednostavnost upotrebe ključna je značajka LiDE 200. Intuitivan softver omogućava brzo postavljanje i odabir postavki, dok USB napajanje olakšava povezivanje s računalom. Sposobnost skeniranja direktno na PDF dodatno pojednostavljuje proces rukovanja dokumentima.', 'Ugovor 50/2023', 12, '1300-2545888', 17, 0, '2024-02-02 13:58:53', '2023-11-13 23:36:28'),
	(46, 'Canon CanoScan LiDE 110', 'Canon CanoScan LiDE 110 je kompaktan plosni skener dizajniran za osobnu upotrebu. Sa svojom jednostavnom instalacijom, tankim profilom i visokokvalitetnim skeniranjem, LiDE 110 pruža praktično rješenje za korisnike koji žele lako digitalizirati dokumente i fotografije kod kuće.', 'CanoScan LiDE 110 je skener koji se ističe svojom jednostavnošću i funkcionalnošću. S tanak profil od samo nekoliko centimetara, ovaj skener je lako prenosiv i ne zauzima puno prostora na stolu. Unatoč svojoj kompaktnoj veličini, LiDE 110 pruža visoku razlučivost skeniranja, čineći ga pogodnim za razne potrebe kućne digitalizacije.\n\nSenzor CIS (Contact Image Sensor) omogućuje brzo skeniranje dokumenata i fotografija. LiDE 110 podržava skeniranje u boji i dubinu boje od 48-bitne internu, odnosno 24-bitnu eksternu. Brza brzina skeniranja čini ovaj uređaj praktičnim za korisnike koji žele brzo digitalizirati svoje materijale.\n\nJednostavnost korištenja dodatno je naglašena intuitivnim softverom koji olakšava postavljanje i odabir postavki skeniranja. USB napajanje čini povezivanje s računalom brzim i jednostavnim. LiDE 110 također nudi funkcije poput automatskog ispravljanja defekata slike, što doprinosi kvaliteti skeniranih rezultata.', 'Ugovor 51/2023', 12, '1300-584554', 31, 1, '2023-11-13 23:38:11', '2023-11-13 23:38:11'),
	(47, 'Canon CanoScan LiDE 300', 'Canon CanoScan LiDE 300 je ultratanak plosni skener namijenjen pojedincima i kućanstvima. S elegantnim dizajnom, ovaj skener nudi visoku razlučivost skeniranja i brzinu, čineći ga savršenim alatom za brzo i jednostavno digitaliziranje dokumenata i fotografija kod kuće.', 'CanoScan LiDE 300 predstavlja kombinaciju elegantnog dizajna i visokih performansi u kompaktnom pakiranju. Tanki profil skenera čini ga lako prenosivim i prikladnim za kućnu upotrebu. S naprednim CIS (Contact Image Sensor) senzorom, LiDE 300 pruža visokokvalitetno skeniranje s brzinom i preciznošću.\n\nBrza brzina skeniranja omogućuje korisnicima efikasno digitaliziranje dokumenata. LiDE 300 podržava rezoluciju skeniranja od 2400 x 4800 dpi, što rezultira jasnim i oštrim reprodukcijama. Ovaj skener podržava skeniranje u boji s dubinom boje od 48-bitnom internu i 24-bitnom eksternu.\n\nJednostavnost korištenja naglašena je intuitivnim softverom koji olakšava postavljanje i kontrolu postavki skeniranja. Povezivanje s računalom je brzo putem USB veze, a USB napajanje eliminira potrebu za dodatnim vanjskim napajanjem.', 'Ugovor 53/2023', 12, '1300-584855', 6, 1, '2023-11-13 23:39:53', '2023-11-13 23:39:53'),
	(48, 'Kyocera TaskAlfa 3051ci', 'Kyocera TaskAlfa 3051ci je multifunkcijski kolor laserski printer namijenjen poslovnim okruženjima. Ovaj uređaj kombinira visokokvalitetan ispis u boji s naprednim mogućnostima kopiranja, skeniranja i opcijama slanja faksova. Sa svojom svestranom funkcionalnošću i pouzdanim performansama, TaskAlfa 3051ci zadovoljava potrebe modernih radnih grupa.', 'Kyocera TaskAlfa 3051ci je svestran i pouzdan uređaj, idealan za radne grupe koje zahtijevaju visokokvalitetan ispis u boji. S obzirom na brzinu ispisa od do 30 stranica u minuti, ovaj printer osigurava učinkovito rukovanje s dokumentima. Skeniranje u boji i mogućnost slanja faksova čine ga potpunim rješenjem za sve poslovne potrebe.\n\nOpremljen naprednim sigurnosnim značajkama, TaskAlfa 3051ci štiti osjetljive informacije i osigurava sigurnost podataka. Veliki dodirni zaslon osjetljiv na dodir olakšava upravljanje funkcijama printanja, kopiranja i skeniranja. Intuitivno sučelje čini ovaj uređaj jednostavnim za korištenje, čak i za korisnike bez prethodnog iskustva s uređajima ovog tipa.', 'Ugovor 49/2023', 11, '1300-5844862', 1, 1, '2023-11-14 22:05:17', '2023-11-14 22:05:17'),
	(49, 'HP ScanJet G4050', 'HP ScanJet G4050 je visokokvalitetan plosni skener dizajniran za zadovoljenje potreba korisnika koji zahtijevaju vrhunsku razlučivost i reprodukciju boja. S naprednim značajkama skeniranja i mogućnostima rukovanja različitim vrstama medija, ovaj skener pruža svestranost i preciznost u digitalizaciji dokumenata i fotografija.', 'HP ScanJet G4050 ističe se po svojoj sposobnosti pružanja visokokvalitetnih rezultata skeniranja uz iznimnu razlučivost od 4800 x 9600 dpi. S tehnologijom HP\'s exclusive 6-color, ovaj skener omogućuje preciznu reprodukciju boja i detalja, čineći ga idealnim za skeniranje fotografija visoke kvalitete.\n\nOpremljen prozirnim pokrovom za skeniranje filmova i dijapozitiva, G4050 pruža dodatnu funkcionalnost za ljubitelje fotografije. Automatsko ispravljanje defekata slike i poboljšane značajke redukcije prašine osiguravaju čiste i jasne rezultate skeniranja. Skener također podržava brzo skeniranje i omogućuje korisnicima učinkovito rukovanje različitim vrstama medija.\n\nJednostavno rukovanje omogućeno je intuitivnim sučeljem i softverom koji olakšava postavljanje i upravljanje postavkama skeniranja. Povezivanje s računalom je brzo putem USB veze, a skener dolazi s naprednim softverskim alatima za uređivanje i organizaciju skeniranih materijala.', 'Ugovor 50/2023', 12, '1300-5865565', 14, 0, '2023-11-14 22:07:48', '2023-11-14 22:07:48'),
	(50, 'Canon imageFORMULA DR-M140', 'Canon imageFORMULA DR-M140 je svestran i visokoučinkovit plosni skener dizajniran za rad u uredima s velikim volumenom skeniranja. Sa svojom brzinom, pouzdanošću i naprednim značajkama obrade slika, ovaj skener zadovoljava potrebe poslovnih korisnika koji zahtijevaju visokokvalitetno skeniranje i učinkovitu digitalizaciju dokumenata.', 'Canon DR-M140 je plosni skener koji se ističe svojom sposobnošću brze i precizne obrade velikog volumena dokumenata. S brzinom skeniranja od do 40 stranica u minuti (80 sličica u minuti u duplex načinu rada), ovaj skener omogućuje učinkovito rukovanje s različitim vrstama materijala, uključujući obične papire, tanki karton, pa čak i plastične kartice.\n\nVisoka razlučivost skeniranja od 600 dpi osigurava jasne i oštre reprodukcije teksta i slika. DR-M140 podržava automatsko otkrivanje veličine dokumenta i automatsko ispravljanje nagiba, što poboljšava preciznost skeniranja. Dodatno, ovaj skener dolazi s naprednim značajkama obrade slika, uključujući uklanjanje praznina, uklanjanje rupica i poboljšanje teksta.\n\nJednostavno rukovanje olakšano je intuitivnim sučeljem i funkcionalnostima poput automatskog uvlačenja dokumenata. Povezivanje s računalom je brzo i pouzdano putem USB veze. DR-M140 također podržava funkciju duplex skeniranja, čime se povećava produktivnost u radnom okruženju.', 'Ugovor 51/2023', 12, '1300-654325', 4, 0, '2023-11-14 22:18:01', '2023-11-14 22:18:01'),
	(51, 'HP ScanJet G4010', 'HP ScanJet G4010 je visokokvalitetni plosni skener dizajniran za kućnu upotrebu i male urede. Sa svojom sposobnošću skeniranja visokokvalitetnih slika i dokumenata, G4010 pruža jednostavno rukovanje i razne opcije obrade slika, čineći ga savršenim rješenjem za korisnike koji žele preciznost u digitalizaciji različitih medija.', 'HP ScanJet G4010 pruža visoku razlučivost skeniranja od 4800 x 9600 dpi, što omogućava detaljno skeniranje slika i dokumenata. Opremljen tehnologijom HP\'s exclusive 6-color, ovaj skener pruža živopisne i precizne reprodukcije boja, što ga čini idealnim za skeniranje fotografija i umjetničkih djela.\n\nSkener podržava razne vrste medija, uključujući prozirne materijale i filmove, čime omogućuje korisnicima širok spektar mogućnosti skeniranja. Automatsko ispravljanje defekata slike i napredne značajke poput tehnologije HP Real Life Technologies dodatno poboljšavaju kvalitetu skeniranih rezultata.\n\nJednostavno rukovanje olakšano je intuitivnim sučeljem i softverom koji omogućuje brzo postavljanje i odabir postavki skeniranja. Povezivanje s računalom je brzo putem USB veze. G4010 također dolazi s naprednim softverskim alatima za uređivanje i organizaciju skeniranih materijala.', 'Ugovor 52/2023', 12, '1300-556543', 7, 1, '2024-02-02 14:00:08', '2023-11-14 22:21:09'),
	(52, 'HP ScanJet 3800', '', '', 'Ugovor 53/2023', 12, '1300-5595585', 2, 0, '2023-11-14 22:26:04', '2023-11-14 22:26:04'),
	(53, 'Canon imageFORMULA DR-6030C', 'Canon imageFORMULA DR-6030C je snažan i kompaktan plosni skener dizajniran za visokoučinkovito skeniranje u uredskim okruženjima s velikim volumenom dokumenata. Sa svojom iznimnom brzinom, visokom razlučivošću i naprednim značajkama obrade slika, ovaj skener odgovara potrebama poslovnih korisnika koji zahtijevaju pouzdano rukovanje s različitim vrstama materijala.', 'Canon DR-6030C pruža visoku razlučivost skeniranja od 600 dpi i sposoban je rukovati različitim veličinama dokumenata, uključujući i dugmad od preko 3 metra. Sa svojom impresivnom brzinom skeniranja od do 80 stranica u minuti (160 sličica u minuti u duplex načinu rada), ovaj skener osigurava učinkovito i brzo digitaliziranje dokumenata.\n\nSenzor s naprednom tehnologijom i tehnologijom ispravljanja slika omogućuje precizno skeniranje s minimalnim defektima. Automatsko uvlačenje dokumenata, automatsko prepoznavanje veličine i opcije obrade slika poput uklanjanja praznina dodatno olakšavaju rad s raznovrsnim dokumentima.\n\nJednostavno rukovanje podržano je intuitivnim sučeljem, a skener se može lako integrirati u različite radne tokove pomoću softverskih alata za upravljanje dokumentima. Povezivanje s računalom je brzo i pouzdano putem USB ili SCSI veze.', 'Ugovor 54/2023', 12, '1300-585555', 2, 0, '2023-11-14 22:29:15', '2023-11-14 22:29:15'),
	(54, 'Kyocera FS-4200DN', 'Kyocera FS-4200DN je monohromatski laserski printer namijenjen poslovnim potrebama. Sa svojom visokom brzinom ispisa, pouzdanošću i ekonomičnošću, ovaj printer je idealan za radna okruženja koja zahtijevaju učinkovit ispis teksta visoke kvalitete.', 'Kyocera FS-4200DN je monohromatski laser printer koji ističe svojom brzinom i visokom razlučivošću ispisa. Brzina ispisa od do 50 stranica u minuti čini ga izuzetno učinkovitim za poslovne okoline s visokim volumenom ispisa. Rezolucija ispisa od 1200 x 1200 dpi osigurava oštar tekst i jasne grafike.\n\nOvaj printer nudi automatski dvostrani ispis, što pomaže u smanjenju potrošnje papira i troškova ispisa. Veliki kapacitet ulazne ladice (do 500 listova) dodatno povećava produktivnost i smanjuje potrebu za čestim punjenjem papira.\n\nS obzirom na svoju ekonomičnost, FS-4200DN je idealan za poslovna okruženja gdje je važna racionalizacija troškova ispisa. Povezivanje putem USB-a, Etherneta i opcionalno bežično povezivanje pruža fleksibilnost u integraciji u različite radne okoline.', 'Ugovor 55/2023', 11, '1300-254885', 28, 1, '2024-04-12 05:33:31', '2023-11-14 22:35:33'),
	(55, 'Canon imageRUNNER 2520', 'Canon imageRUNNER 2520 je višenamjenski crno-bijeli laserski printer dizajniran za povećanje produktivnosti u uredima srednje veličine. Sa svojom sposobnošću printanja, kopiranja i skeniranja, ovaj uređaj pruža pouzdanost i funkcionalnost koja zadovoljava potrebe modernih radnih okruženja.', 'Canon imageRUNNER 2520 je uređaj s višestrukim funkcijama koji kombinira visokokvalitetan crno-bijeli ispis s mogućnostima kopiranja i skeniranja. Brzina ispisa od 20 stranica u minuti čini ga pogodnim za uredske radne skupine s umjerenim volumenom ispisa.\n\nSposobnost automatskog dvostranog ispisa smanjuje potrošnju papira, dok veliki kapacitet ulazne ladice (do 2500 listova) olakšava upravljanje dokumentima i smanjuje vrijeme održavanja uređaja.\n\nJednostavno rukovanje uređajem olakšano je putem intuitivnog zaslona osjetljivog na dodir, omogućavajući korisnicima brz pristup funkcijama printanja, kopiranja i skeniranja. Ugrađena sigurnosna značajka dodatno štiti osjetljive informacije.', 'Ugovor 56/2023', 11, '1300-255848', 19, 3, '2024-05-17 05:50:33', '2023-11-14 22:37:13'),
	(56, 'Kyocera FS-3920DN', 'Kyocera FS-3920DN je monohromatski laserski printer s visokom brzinom ispisa, namijenjen poslovnim okruženjima koja zahtijevaju pouzdanost i visoku produktivnost. Sa sposobnošću automatskog dvostranog ispisa, velikim kapacitetom ulazne ladice i energetski učinkovitim radom, ovaj printer pruža učinkovito rješenje za uredske potrebe.', 'Kyocera FS-3920DN se ističe po visokoj brzini ispisa od do 40 stranica u minuti, čineći ga idealnim izborom za poslovna okruženja s povećanim volumenom ispisa. Ova brzina, uz rezoluciju ispisa od 1200 dpi, osigurava oštar tekst i jasne grafike.\n\nAutomatski dvostrani ispis pomaže u smanjenju potrošnje papira, dok veliki kapacitet ulazne ladice (do 500 listova) olakšava upravljanje dokumentima i smanjuje potrebu za čestim punjenjem papira.\n\nFS-3920DN također se ističe po energetski učinkovitom radu, čime pridonosi smanjenju troškova i pozitivnom utjecaju na okoliš. Mogućnost povezivanja putem USB-a i Ethernet-a omogućuje jednostavnu integraciju u različite radne okoline.', 'Ugovor 57/2023', 11, '1300-584151', 8, 2, '2024-04-12 09:04:33', '2023-11-14 22:38:44'),
	(57, 'Lexmark E360d', 'Lexmark E360d je monohromatski laserski printer namijenjen radnim grupama i manjim uredima koji traže pouzdan i ekonomičan uređaj. S sposobnošću dvostranog ispisa, brzinom ispisa do 38 stranica u minuti, te kompaktnim dizajnom, ovaj printer pruža jednostavno rukovanje i visoku učinkovitost.', 'Lexmark E360d kombinira brzinu ispisa i kompaktan dizajn kako bi zadovoljio potrebe manjih ureda. S brzinom ispisa od 38 stranica u minuti i rezolucijom ispisa od 1200 x 1200 dpi, ovaj printer osigurava oštar tekst i profesionalne dokumente.\n\nJedna od ključnih značajki E360d je mogućnost automatskog dvostranog ispisa, što doprinosi smanjenju potrošnje papira i troškova ispisa. S kapacitetom ulazne ladice od 250 listova, uređaj je pogodan za radne okoline s umjerenim do srednjim volumenom ispisa.\n\nKorisnicima olakšava rukovanje putem jednostavnog kontrolnog panela, a povezivanje s računalom je brzo i jednostavno putem USB veze. Ovaj printer također pruža jednostavnu integraciju u radne okoline putem Ethernet povezivanja.', 'Ugovor 58/2023', 11, '1300-558898', 8, 4, '2023-11-14 22:40:13', '2023-11-14 22:40:13'),
	(58, 'Lexmark MS810', 'Lexmark MS810 je monohromatski laserski printer dizajniran za poslovna okruženja koja zahtijevaju visok volumen ispisa i brzinu. Sa svojom sposobnošću brzog ispisa, naprednim sigurnosnim značajkama i opcijom automatskog dvostranog ispisa, MS810 pruža pouzdanost i efikasnost u radu.', 'Lexmark MS810 predstavlja snažan laserski printer s brzinom ispisa do 55 stranica u minuti i rezolucijom ispisa od 1200 x 1200 dpi, osiguravajući brz i visokokvalitetan ispis teksta i grafika. Ovaj model je posebno dizajniran za poslovna okruženja s velikim volumenom ispisa.\n\nJedna od ključnih prednosti MS810 je sigurnost podataka, s ugrađenim sigurnosnim značajkama poput zaštite lozinkom i kontrole pristupa. Automatski dvostrani ispis pomaže u smanjenju potrošnje papira, a kapacitet ulazne ladice od do 650 listova omogućuje dugotrajno radno vrijeme prije potrebe za ponovnim punjenjem papira.\n\nJednostavno upravljanje uređajem olakšano je putem zaslona osjetljivog na dodir, a povezivanje s računalom ili mrežom se postiže putem USB-a ili Ethernet veze.', 'Ugovor 60/2023', 11, '1300-545483', 8, 0, '2023-11-14 22:41:51', '2023-11-14 22:41:51'),
	(59, 'Lexmark E460', 'Lexmark E460 je monohromatski laserski printer koji nudi pouzdan ispis visoke kvalitete za male i srednje radne grupe. S brzinom ispisa, naprednim značajkama sigurnosti i opcijom automatskog dvostranog ispisa, E460 zadovoljava potrebe ureda koji traže efikasan i pouzdan pisač.', 'Lexmark E460 kombinira brzinu ispisa i jednostavnost rukovanja kako bi odgovorio na potrebe manjih i srednjih ureda. Brzina ispisa ovog modela prilagođena je potrebama radnih grupa, a rezolucija ispisa od 1200 x 1200 dpi osigurava kvalitetan ispis teksta i grafika.\n\nAutomatski dvostrani ispis smanjuje potrošnju papira i troškove ispisa, dok kapacitet ulazne ladice doprinosi dugotrajnom radu bez potrebe za čestim punjenjem papira. Ugrađene sigurnosne značajke, poput zaštite lozinkom, pridonose zaštiti osjetljivih podataka.\n\nUpravljanje uređajem je jednostavno putem kontrolnog panela, a povezivanje s računalom ili mrežom ostvaruje se putem USB-a ili Ethernet veze.', 'Ugovor 61/2023', 11, '1300-559435', 7, 1, '2024-01-25 08:28:54', '2023-11-14 22:43:26'),
	(60, 'Kyocera FS-4020DN', 'Kyocera FS-4020DN je monohromatski laserski printer namijenjen poslovnim okruženjima koja zahtijevaju visok volumen ispisa i brzinu. S naprednim sigurnosnim značajkama, mogućnošću automatskog dvostranog ispisa i energetski učinkovitim radom, ovaj printer pruža pouzdane performanse.', 'Kyocera FS-4020DN predstavlja snažan monohromatski laserski printer s brzinom ispisa do određenog broja stranica u minuti (specifično za model) i rezolucijom ispisa koja osigurava visokokvalitetan tekstualni ispis. Ovaj printer je posebno dizajniran za poslovna okruženja s visokim volumenom ispisa.\n\nJedna od ključnih značajki FS-4020DN je sigurnost podataka, s ugrađenim sigurnosnim značajkama poput zaštite lozinkom i kontrole pristupa. Automatski dvostrani ispis smanjuje potrošnju papira, a kapacitet ulazne ladice omogućuje dugotrajno radno vrijeme prije potrebe za ponovnim punjenjem papira.\n\nPrinter nudi jednostavno upravljanje putem kontrolnog panela, a povezivanje s računalom ili mrežom ostvaruje se putem USB-a ili Ethernet veze.', 'Ugovor 62/2023', 11, '1300-589545', 6, 1, '2024-03-12 10:11:26', '2023-11-14 22:44:57'),
	(61, 'Canon imageRUNNER 2016J', 'Canon imageRUNNER 2016J je kompaktni višenamjenski uređaj koji kombinira funkcionalnosti printanja, kopiranja i skeniranja. Namijenjen manjim uredima i radnim grupama, pruža pouzdan rad i temeljne značajke potrebne za svakodnevne uredske zadatke.', 'Canon imageRUNNER 2016J je multifunkcijski uređaj koji nudi osnovne funkcionalnosti za male uredske okoline. S brzinom ispisa i kopiranja određenom broju stranica u minuti (specifično za model), ovaj uređaj zadovoljava potrebe korisnika koji traže jednostavno i pouzdano rješenje.\n\nJednostavno rukovanje ovim uređajem olakšano je intuitivnim sučeljem, a opcije kopiranja i skeniranja dodatno povećavaju funkcionalnost. Automatsko uvlačenje dokumenata čini proces kopiranja i skeniranja učinkovitijim.\n\nCanon imageRUNNER 2016J nudi praktične značajke, uključujući automatski dvostrani ispis za smanjenje potrošnje papira. Sigurnosne značajke, poput zaštite lozinkom, pridonose zaštiti osjetljivih informacija.', 'Ugovor 63/2023', 11, '1300-5854882', 4, 0, '2023-11-15 13:32:07', '2023-11-15 13:32:07'),
	(62, 'Xerox WorkCentre 3335', 'Xerox WorkCentre 3335 je multifunkcijski uređaj koji spaja visokokvalitetan ispis, kopiranje, skeniranje i opcije slanja faksova u jednom kompaktnom uređaju. Namijenjen manjim uredima, ovaj uređaj pruža učinkovitost i pouzdanost u obavljanju uredskih zadataka.', 'Xerox WorkCentre 3335 je multifunkcijski uređaj koji kombinira brzinu ispisa, kvalitetan ispis teksta, te dodatne funkcionalnosti za zadovoljenje različitih potreba uredskih okruženja. S brzinom ispisa i kopiranja određenom broju stranica u minuti (specifično za model), ovaj uređaj je prilagođen radu u manjim radnim grupama.\n\nAutomatski dvostrani ispis pomaže u smanjenju potrošnje papira, dok kapacitet ulazne ladice doprinosi smanjenju čestog punjenja papira. Uz intuitivno sučelje i opcije povezivanja poput USB-a i Ethernet-a, korisnici lako upravljaju uređajem i integriraju ga u svoje radno okruženje.\n\nDodatne funkcije, poput automatskog dokumentnog uvlakača i opcije slanja faksova, čine WorkCentre 3335 sveobuhvatnim uređajem za uredske zadatke. Sigurnosne značajke, uključujući zaštitu lozinkom, pridonose zaštiti osjetljivih informacija.', 'Ugovor 65/2023', 11, '1300-1856984', 3, 2, '2023-11-15 13:33:30', '2023-11-15 13:33:30'),
	(63, 'Canon imageRUNNER 1325', 'Canon imageRUNNER 1325 je kompaktni višenamjenski uređaj koji objedinjuje funkcije printanja, kopiranja i skeniranja. Namijenjen manjim radnim grupama i uredima, ovaj uređaj pruža osnovne značajke potrebne za svakodnevne uredske zadatke.', 'Canon imageRUNNER 1325 je multifunkcijski uređaj s naglaskom na jednostavnosti rukovanja i osnovnim funkcionalnostima. S brzinom ispisa i kopiranja određenom broju stranica u minuti (specifično za model), ovaj uređaj prilagođen je potrebama manjih radnih grupa i ureda.\n\nAutomatsko uvlačenje dokumenata olakšava proces kopiranja i skeniranja više stranica, dok opcije automatskog dvostranog ispisa smanjuju potrošnju papira. Uređaj nudi intuitivno korisničko sučelje, čineći rukovanje uređajem jednostavnim i brzim.\n\nCanon imageRUNNER 1325 također uključuje sigurnosne značajke, poput zaštite lozinkom, kako bi osigurao zaštitu osjetljivih informacija. Opcije povezivanja, poput USB-a, omogućuju jednostavno integriranje uređaja u uredske okoline.', 'Ugovor 66/2023', 11, '1300-584855', 2, 0, '2023-11-15 13:35:35', '2023-11-15 13:35:35'),
	(64, 'Kyocera ECOSYS M8124cidn', 'Kyocera ECOSYS M8124cidn je multifunkcijski uređaj namijenjen poslovnim okruženjima koja zahtijevaju visokokvalitetan ispis u boji i napredne funkcionalnosti. S visokom brzinom ispisa, automatskim dvostranim ispisom, i bogatim skupom značajki, ovaj uređaj pruža svestranost i pouzdanost za radne grupe.', 'Kyocera ECOSYS M8124cidn kombinira visokokvalitetan ispis u boji, kopiranje, skeniranje i opciju slanja faksova u jednom svestranom uređaju. Brzina ispisa do određenog broja stranica u minuti (specifično za model) osigurava učinkovito rukovanje s dokumentima, dok automatski dvostrani ispis doprinosi smanjenju potrošnje papira.\n\nOpremljen naprednim sigurnosnim značajkama, poput enkripcije podataka i kontrole pristupa, ECOSYS M8124cidn štiti osjetljive informacije. Veliki dodirni zaslon olakšava upravljanje funkcijama, a intuitivno sučelje čini uređaj jednostavnim za korištenje.\n\nS obzirom na kapacitet ulazne ladice do određenog broja listova (specifično za model), ovaj uređaj je prikladan za radne grupe s raznolikim uredskim potrebama. Mogućnost povezivanja putem USB-a, Ethernet-a i bežične veze pruža fleksibilnost u integraciji u različite radne okoline.', 'Ugovor 67/2023', 11, '1300-5459645', 0, 0, '2023-11-15 13:37:22', '2023-11-15 13:37:22'),
	(65, 'Kyocera ECOSYS M6526cdn', 'Kyocera ECOSYS M6526cdn je višenamjenski uređaj koji kombinira visokokvalitetan ispis u boji, kopiranje, skeniranje i opciju slanja faksova. Namijenjen malim i srednjim radnim grupama, ovaj uređaj pruža pouzdanost, učinkovitost i napredne značajke za zadovoljenje uredskih potreba.', 'Kyocera ECOSYS M6526cdn je multifunkcijski uređaj koji nudi visokokvalitetan ispis u boji i fleksibilne mogućnosti rukovanja dokumentima. Brzina ispisa do određenog broja stranica u minuti (specifično za model) omogućava brzo i učinkovito rukovanje zadacima.\n\nAutomatski dvostrani ispis smanjuje potrošnju papira, dok napredne značajke poput automatskog dokumentnog uvlakača čine proces kopiranja i skeniranja jednostavnijim i bržim. Veliki dodirni zaslon omogućava lako upravljanje funkcijama, a intuitivno sučelje čini uređaj pristupačnim i korisnicima bez prethodnog iskustva.\n\nUgrađene sigurnosne značajke, poput enkripcije podataka i kontrole pristupa, čuvaju osjetljive informacije. S mogućnostima povezivanja putem USB-a, Ethernet-a i bežične veze, ECOSYS M6526cdn prilagođava se različitim uredskim okruženjima.', 'Ugovor 68/2023', 11, '1300-546464', 4, 2, '2024-04-12 05:41:23', '2023-11-15 13:38:48'),
	(66, 'Kyocera FS 1370 DN ', 'KYOCERA FS-1370DN je snažan laserski printer dizajniran za zadovoljenje potreba poslovnih korisnika. Sa svojim kompaktnim dimenzijama, lako se uklapa u radni prostor, dok istovremeno pruža visokokvalitetne ispise.', 'Ovaj printer se ističe svojom sposobnošću brze štampe uz očuvanje visokog kvaliteta. Nudi dvostrano štampanje, što čini proces štampe ekonomičnim i ekološki prihvatljivim. Koristi KYOCERA ECOSYS tehnologiju, koja osigurava dug životni vijek komponenti, smanjujući ukupne operativne troškove.\n\nFS-1370DN podržava razne medije i formate, uključujući standardne i prilagođene veličine papira. Brzina štampe odnosi se na impresivnih X stranica u minuti, čime se zadovoljavaju zahtjevi dinamičnog poslovnog okruženja.', 'Ugovor 69/2023', 11, '1300-585494', 2, 0, '2023-11-15 13:41:12', '2023-11-15 13:41:12'),
	(67, 'Ricoh MP 2014D', 'RICOH MP 2014D je svestrani monohromatski laserski printer koji kombinira kompaktni dizajn s visokom produktivnošću. Ovaj model cilja na efikasnost i pouzdanost u svakodnevnim poslovnim zadacima.', 'RICOH MP 2014D je namijenjen korisnicima koji traže jednostavan, ali efikasan uređaj za štampanje. S njegovim kompaktnim dimenzijama, ovaj printer lako se integrira u različite radne okoline, a jednostavno rukovanje čini ga prikladnim za svakodnevne poslovne zadatke.\n\nOvaj model također nudi dvostrani ispis, pomažući korisnicima u smanjenju potrošnje papira i troškova. Brza brzina ispisa i visoka rezolucija čine ga pogodnim za različite vrste dokumenata.', 'Ugovor 70/2023', 11, '1300-254558', 2, 2, '2023-11-15 13:44:17', '2023-11-15 13:44:17'),
	(68, 'Lexmark T652N', 'LEXMARK T652N je snažan monohromatski laserski printer koji kombinira visoku brzinu ispisa s robustnim dizajnom. Namijenjen je poslovnim korisnicima koji zahtijevaju pouzdanost i efikasnost u štampanju velikih količina dokumenata.', 'LEXMARK T652N donosi snažne performanse u kompaktnom i robusnom kućištu. S visokom brzinom ispisa i kapacitetom papira, ovaj printer odgovara zahtjevima dinamičnih radnih okolina. Uz podršku za različite formate i vrste medija, korisnici imaju fleksibilnost u odabiru materijala za štampanje.\n\nDvostrani ispis i veliki kapacitet tonera čine ovaj model ekonomičnim i pogodnim za smanjenje ukupnih troškova štampe. LEXMARK T652N također pruža jednostavno upravljanje putem korisničkog sučelja, čineći ga intuitivnim za korištenje.', 'Ugovor 71/2023', 11, '1300-556433', 2, 0, '2023-11-15 13:46:37', '2023-11-15 13:46:37'),
	(69, 'LEXMARK T650N', 'LEXMARK T650N je snažan monohromatski laserski printer koji se ističe visokom brzinom ispisa i robusnim dizajnom. Namijenjen je poslovnim korisnicima koji traže pouzdanost, brzinu i visokokvalitetne ispisne rezultate.', 'LEXMARK T650N pruža snažne performanse u kompaktnom kućištu. Sa brzinom ispisa koja odgovara dinamičnom radnom okruženju, ovaj printer također nudi visoku rezoluciju ispisa za jasne tekstualne i grafičke rezultate. Sposobnost dvostranog ispisa i podrška za različite vrste medija čine ga fleksibilnim u zadovoljavanju različitih poslovnih potreba.\n\nJednostavno upravljanje, intuitivno korisničko sučelje te veliki kapacitet tonera čine LEXMARK T650N prikladnim izborom za korisnike koji traže efikasan i pouzdan laserski printer.', 'Ugovor 71/2023', 11, '1300-5857885', 1, 0, '2023-11-15 13:48:22', '2023-11-15 13:48:22'),
	(70, 'Kyocera ECOSYS M4125idn', 'Kyocera ECOSYS M4125idn je visokoučinkovit multifunkcijski laserski uređaj koji kombinira brzinu štampe, kopiranja i skeniranja s ekološkom osviješćenošću. Ovaj model je dizajniran za poslovne okoline koje zahtijevaju svestranost i pouzdanost.', 'ECOSYS M4125idn donosi napredne funkcionalnosti u kompaktnom i robusnom kućištu. Sa brzinom štampe i kopiranja koja zadovoljava potrebe dinamičnih uredskih okruženja, ovaj uređaj također nudi napredne opcije skeniranja za učinkovito upravljanje dokumentima.\n\nOdrživa Kyocera ECOSYS tehnologija smanjuje ukupne troškove vlasništva, a mogućnost dvostranog ispisa i energetske učinkovitosti čine ga odgovornim izborom za ekološki osviještene organizacije.', 'Ugovor 72/2023', 11, '1300-588454', 1, 0, '2023-11-15 13:50:57', '2023-11-15 13:50:57'),
	(71, 'HP Color LaserJet 5550', 'HP Color LaserJet 5550 je snažan i visokokvalitetni laserski pisač u boji, koji se ističe brzinom ispisa i sposobnošću tiskanja u boji. Namijenjen je poslovnim korisnicima koji zahtijevaju profesionalne ispisne rezultate u boji.', 'Color LaserJet 5550 donosi visoku produktivnost u uredske okoline, pružajući brze i precizne ispisne rezultate u boji. Sa svestranom podrškom za različite medije i formate papira, ovaj pisač odgovara raznovrsnim potrebama poslovnog okruženja.\n\nBrzina ispisa u kombinaciji s visokom rezolucijom omogućava jasne i oštre dokumente. Pisač također podržava dvostrani ispis za povećanje ekonomske iskoristivosti papira.', 'Ugovor 72/2023', 11, '1300-858433', 1, 1, '2023-11-15 13:53:06', '2023-11-15 13:53:06'),
	(72, 'Kyocera ECOSYS M3550idn', 'Kyocera ECOSYS M3550idn je svestrani monohromatski multifunkcijski laserski uređaj koji kombinira brzinu ispisa, kopiranja, skeniranja i faksa. Ovaj uređaj pruža efikasnost i pouzdanost u uredskim okruženjima s visokim zahtjevima.', 'ECOSYS M3550idn donosi napredne funkcionalnosti u kompaktnom i robusnom kućištu. Brza brzina ispisa, visoka rezolucija i napredne opcije skeniranja čine ovaj uređaj idealnim za poslovne korisnike koji zahtijevaju svestranost u rukovanju dokumentima.\n\nUz podršku za dvostrani ispis, veliki kapacitet ladice za papir i energetsku učinkovitost, M3550idn slijedi Kyocera-ino opredjeljenje za ekološki prihvatljive tehnologije s niskim troškovima održavanja.', 'Ugovor 73/2023', 11, '1300-856545', 1, 0, '2023-11-15 13:54:31', '2023-11-15 13:54:31'),
	(73, 'Kyocera ECOSYS P2135dn', 'Kyocera ECOSYS P2135dn je monohromatski laserski pisač koji kombinira kompaktni dizajn s visokom učinkovitošću. Namijenjen je korisnicima koji zahtijevaju pouzdanost i brzinu ispisa u jednostavnom uređaju.', 'ECOSYS P2135dn predstavlja pristupačno rješenje za korisnike koji traže svestrani i kompaktni pisač. Sa svojom brzom brzinom ispisa i sposobnošću dvostranog ispisa, ovaj pisač odgovara osnovnim potrebama za monohromatskim ispisom dokumenata.\n\nPisač koristi Kyocera ECOSYS tehnologiju koja smanjuje troškove održavanja i podržava ekološki prihvatljive prakse. Kombinacija brzine i pouzdanosti čini ovaj model pogodnim za manje uredske okoline', 'Ugovor 74/2023', 11, '1300-526532', 1, 0, '2023-11-15 13:56:14', '2023-11-15 13:56:14'),
	(74, 'HP DesignJet 510', 'HP DesignJet 510 je širokoformatni ploter dizajniran za profesionalce koji zahtijevaju visokokvalitetne ispise u velikim formatima. Ovaj ploter kombinira preciznost i brzinu, čineći ga idealnim rješenjem za inženjerske i grafičke primjene.', 'HP DesignJet 510 je širokoformatni ploter dizajniran za profesionalce koji zahtijevaju visokokvalitetne ispise u velikim formatima. Ovaj ploter kombinira preciznost i brzinu, čineći ga idealnim rješenjem za inženjerske i grafičke primjene.', 'Ugovor 75/2023', 11, '1300-546546', 1, 1, '2023-11-15 14:20:45', '2023-11-15 14:20:45'),
	(75, 'HP DesignJet 500 Plus', 'HP DesignJet 500 Plus je širokoformatni ploter koji kombinira preciznost, brzinu i pouzdanost. Dizajniran za profesionalce u inženjerskim i grafičkim područjima, ovaj ploter pruža visokokvalitetne ispise u velikim formatima, čineći ga savršenim rješenjem za različite aplikacije.', 'HP DesignJet 500 Plus je širokoformatni ploter koji kombinira preciznost, brzinu i pouzdanost. Dizajniran za profesionalce u inženjerskim i grafičkim područjima, ovaj ploter pruža visokokvalitetne ispise u velikim formatima, čineći ga savršenim rješenjem za različite aplikacije.', 'Ugovor 76/2023', 11, '1300-2541641', 1, 0, '2023-11-15 14:22:41', '2023-11-15 14:22:41'),
	(76, 'HP DesignJet 510 42', 'HP DesignJet 510 42 je širokoformatni ploter dizajniran za pružanje visokokvalitetnih ispisa u velikim formatima. Ovaj ploter odlikuje se preciznošću, brzinom i pouzdanošću, čineći ga idealnim rješenjem za inženjerske i grafičke aplikacije.', 'HP DesignJet 510 42 je širokoformatni ploter dizajniran za pružanje visokokvalitetnih ispisa u velikim formatima. Ovaj ploter odlikuje se preciznošću, brzinom i pouzdanošću, čineći ga idealnim rješenjem za inženjerske i grafičke aplikacije.', 'Ugovor 77/2023', 11, '1300-2546458', 1, 1, '2023-11-15 14:24:27', '2023-11-15 14:24:27'),
	(77, 'ME P1000', 'Fiskalna kasa ME P1000 predstavlja moderno i pouzdano rješenje za poslovno evidentiranje transakcija. Sa svojim kompaktnim dizajnom i naprednim funkcijama, ova fiskalna kasa je idealna za male i srednje poslovne subjekte koji zahtijevaju efikasno upravljanje prodajom.', 'Fiskalna kasa ME P1000 kombinira sofisticiranu tehnologiju s jednostavnošću korištenja. Sposobna je brzo i precizno evidentirati prodajne transakcije, podržavajući različite metode plaćanja. Pored toga, omogućuje praćenje zaliha, izradu izvještaja i drugih funkcionalnosti koje olakšavaju poslovanje.\n\nErgonomski dizajn i intuitivno korisničko sučelje čine rad s ovom fiskalnom kasom jednostavnim i efikasnim. Pored osnovnih funkcija fiskalizacije, ME P1000 pruža i dodatne mogućnosti prilagođene potrebama modernog poslovanja.', 'Ugovor 79/2023', 13, '1300-5646545', 24, 5, '2024-02-07 06:51:25', '2023-11-15 14:36:32'),
	(78, 'HP Business Inkjet 2800', 'HP Business Inkjet 2800 je visokokvalitetni pisač velikog formata koji kombinira izuzetnu brzinu ispisa s mogućnostima boje. Namijenjen je poslovnim korisnicima koji zahtijevaju profesionalne ispisne rezultate u formi plakata, grafika i drugih velikih dokumenata.', 'HP Business Inkjet 2800 pruža izvanrednu kvalitetu ispisa u boji na raznim medijima i veličinama. S velikim kapacitetom ladice za papir i brzinom ispisa, ovaj pisač je posebno prilagođen za poslovne okoline koje zahtijevaju visokokvalitetne i impresivne dokumente.\n\nOpremljen s HP Thermal Inkjet tehnologijom, pisač donosi oštre i živopisne ispise. Veliki LCD zaslon omogućuje jednostavno upravljanje, a opcije povezivanja, uključujući USB i mrežu, čine ga prilagodljivim različitim radnim okruženjima.', 'Ugovor 79/2023', 11, '1300-5984556', 3, 0, '2023-11-16 13:52:26', '2023-11-16 13:52:26'),
	(79, 'Konica Minolta Bizhub 163', 'Konica Minolta Bizhub 163 je multifunkcijski uređaj koji kombinira štampanje, kopiranje i skeniranje u jednom kompaktnom uređaju. Namijenjen je manjim i srednjim poslovnim okruženjima, pružajući pouzdane funkcionalnosti i jednostavno rukovanje dokumentima.', 'Bizhub 163 predstavlja sve-u-jednom rješenje koje objedinjuje osnovne funkcije uredskih uređaja. Brza brzina štampe, automatsko dvostrano kopiranje i opcije skeniranja čine ovaj uređaj prilagodljivim različitim poslovnim potrebama.\n\nJednostavno korisničko sučelje omogućuje intuitivno upravljanje, dok kompaktni dizajn čini Bizhub 163 prikladnim za uredske prostore s ograničenim prostorom. Ugrađena energetska učinkovitost dodatno pridonosi ukupnoj ekonomičnosti rada.', 'Ugovor 80/2023', 11, '1300-5654345', 3, 0, '2023-11-16 13:59:21', '2023-11-16 13:59:21'),
	(80, 'HP L 1750', '', '', 'Ugovor 81/2023', 4, '1300-5654354', 9, 1, '2023-11-16 14:15:43', '2023-11-16 14:15:43'),
	(81, 'ThinkPad T540p', 'Lenovo ThinkPad T540p je prijenosno računalo koje kombinira izdržljivost, performanse i sigurnost, čineći ga pouzdanim partnerom za poslovne korisnike. Sa snažnim procesorima, prostranim zaslonom i nizom sigurnosnih značajki, ThinkPad T540p prilagođava se zahtjevima poslovnog okruženja.', 'ThinkPad T540p spada u Lenovo-ovu seriju poslovnih prijenosnih računala, poznatu po robusnom dizajnu i visokim performansama. Opremljen snažnim procesorima, ovaj model omogućuje brzo izvršavanje zadatka i multitasking. Veliki zaslon pruža korisnicima jasnu i preglednu radnu površinu, što je posebno važno za poslovne aplikacije.\n\nSigurnosne značajke, poput čitača otisaka prstiju i TPM čipa, pružaju dodatni sloj zaštite podataka. Ergonomska tipkovnica, precizni trackpad i razne opcije povezivanja doprinose ukupnoj udobnosti i produktivnosti korisnika.', 'Ugovor 84/2023', 10, '1300-554543', 2, 1, '2024-05-27 10:15:28', '2023-11-16 14:22:48'),
	(82, 'Lenovo ThinkCentre M70 Gen3', 'Lenovo ThinkCentre M70s Gen 3 (Intel) je snažna radna stanica dizajnirana za produktivnost s do 12. generacijom Intel® Core™ i9 vPro® procesora. S kapacitetom do 64 GB DDR4 memorije i opcijama posvećene grafike, ovaj računar olakšava rješavanje višezadaćnosti, operacija s velikim podacima te kompleksnih grafičkih projekata, sve to u kompaktnom kućištu.', 'ThinkCentre M70s Gen 3 (Intel) namijenjen je snažnoj produktivnosti s visoko performantnim procesorima do 12. generacije Intel® Core™ i9 vPro®. Sa do 64 GB DDR4 memorije i opcijama posvećene grafike, ovaj računar osigurava efikasnost pri višezadaćnosti, radu s podacima te složenim grafičkim projektima, sve to unutar kompaktnog kućišta.\n\nRačunar nudi brz start, pretragu i pristup podacima zahvaljujući Gen 4 PCIe SSD (Solid State Drive) pohrani, dok 3D NAND tehnologija osigurava pouzdanu izvedbu i optimalnu potrošnju energije.\n\nFleksibilan je i prilagodljiv, opremljen je različitim opcionalnim I/O portovima i proširivim slotovima koji omogućuju konfiguraciju računara prema specifičnim potrebama korisnika.\n\nPovezivost je olakšana s više portova i bežičnim opcijama, dok inovativni Smart Cable omogućuje učinkovitu suradnju s USB uređajima i čak drugim prijenosnim računarima ili tabletima. DisplayPort i HDMI portovi omogućuju upravljanje do četiri monitora istovremeno, dok dodatni proširni slotovi omogućuju dodatnu konfiguraciju računara.\n\nSigurnost je ključna, podržana Lenovo ThinkShield tehnologijom. Diskretni Trusted Platform Module (dTPM) 2.0 čip osigurava enkripciju podataka, dok BIOS temeljeni Smart USB sprječava neovlašteni pristup. Fizičke bravice štite računar od krađe, a standardi MIL-STD 810H osiguravaju ravnotežu između pouzdanosti i trajnosti.\n\nRačunar je ekološki i korisnički prihvatljiv s certifikatima poput ENERGY STAR® 8.0, EPEAT™ Gold, RoHS i TÜV Low Noise. To znači da je ne samo ekološki, već i prijateljski prema korisnicima.', '161-JP/23', 2, '1300-585564', 26, 0, '2023-11-24 12:06:13', '2023-11-24 12:06:13'),
	(83, 'IIYAMA PROLITE XUB2492HSU-B5 24"', 'Moderan dizajn bez rama čini ProLite XUB2492HSU savršenim za postavljanje sa više monitora. Tehnologija IPS panela nudi preciznu i doslednu reprodukciju boja sa širokim uglovima gledanja. Visoke vrednosti kontrasta i osvetljenosti čine da Vam monitor može pružiti odlične performanse za obradu fotografija i web dizajn. Opremljen zvučnicima, USB čvorištem sa 2 porta, utičnicom za slušalice, HDMI i DisplaiPort priključcima, funkcijom redukcije plavog svetla za smanjenje zamora očiju i ergonomskim postoljem podesivim po visini od 150 mm za optimalnu udobnost korisnika, čine ovaj monitor od 24 inča odličnim izborom za konfiguraciju sa više monitora kao i za kancelarijsku primenu.', 'Moderan dizajn bez rama čini ProLite XUB2492HSU savršenim za postavljanje sa više monitora. Tehnologija IPS panela nudi preciznu i doslednu reprodukciju boja sa širokim uglovima gledanja. Visoke vrednosti kontrasta i osvetljenosti čine da Vam monitor može pružiti odlične performanse za obradu fotografija i web dizajn. Opremljen zvučnicima, USB čvorištem sa 2 porta, utičnicom za slušalice, HDMI i DisplaiPort priključcima, funkcijom redukcije plavog svetla za smanjenje zamora očiju i ergonomskim postoljem podesivim po visini od 150 mm za optimalnu udobnost korisnika, čine ovaj monitor od 24 inča odličnim izborom za konfiguraciju sa više monitora kao i za kancelarijsku primenu.', '159-JP/23', 4, '1300-5858585', 26, 0, '2023-11-24 12:20:55', '2023-11-24 12:20:55'),
